  profile:
    en: The "Wheel of Fortune" and "Strength" are wardens of natural principles that
      watch over the activities of mankind from the space between time. But the appearance
      of 'Star Girl' turns the hourglass and warps the path, gravely changing these
      principles... "Performance Festival" Play - Act 2.
    ja: '『運命の輪』と『力』は、時の狭間で人類の営みを見守り続ける理の管理者。

      だが砂時計を回転させ、道筋を曲げる『星の少女』の出現が、理を大きく変えてゆき……

      ――『劇フェス』戯曲・第二幕より'
    ko: '[운명의 수레바퀴]와 [힘]은 시간의 틈새에서 인류의 흥망을 지켜보는 이치의 관리자.

      그러나 모래시계를 회전시켜 길을 어그러뜨리는 [별의 소녀]의 출현이 이치를 크게 바꾸어가는데...

      ―[극페스] 희곡 제2막에서'
    zh_hant: '『命運之輪』與『力量』為在時間狹縫中守護人類生活的真理管理者。

      但隨著使沙漏倒轉、道理傾斜的『星之少女』的出現，世界的真理也產生了巨大的變化……

      ――取自『戲劇慶典』戲碼・第二幕'
