  profile:
    en: Nothing beats this pair of Kanihaniwa pajamas! After a long day, Karen and
      the other stage girls change into their pajamas and relieve their stress with
      an all-out pillow fight.
    ja: 'カニハニワのパジャマは可愛くて、着心地抜群！

      合宿の夜、パジャマに着替えた華恋たちは、たまには舞台から離れて思いっきり遊ぼうとマクラ投げに興じるのだった。'
    ko: '게 토용 파자마는 귀엽고 착용감도 최고!

      합숙날 밤, 파자마로 갈아입은 카렌 일행은 때로는 무대에서 벗어나 마음껏 놀자며 신나게 베개 싸움을 했다.'
    zh_hant: '蟹土俑的睡衣不但可愛，穿起來也很舒服！

      合宿的夜晚換上睡衣的華戀等人，偶爾也會想離開舞台盡情享受丟枕頭的遊戲。'
