  profile:
    en: Daughter of the vizier destined to be married to a cruel king who killed his
      young wives after one night. To prevent her tragic fate, she enchants him by
      telling stories for one thousand and one nights. From "One Thousand and One
      Nights."
    ja: '若い娘を娶っては一夜のうちに殺してしまう恐ろしい王に嫁いだ、大臣の娘。

      彼女は王の悪行を止めるため、王彼を惹きつける物語を千と一夜に渡って紡ぎ続けた。

      演目『千夜一夜物語』より'
    ko: '젊은 처녀를 신부로 맞이하고는 아침이 오기 전에 죽여버리는 무서운 왕과 결혼한 대신의 딸.

      그녀는 왕의 악행을 막기 위해 왕을 매료시키는 이야기를 천하룻 밤에 걸쳐 이어나갔다.

      작품 [천일야화]에서'
    zh_hant: '身為大臣的女兒，卻嫁給娶了年輕女孩後，便會在當晚將其殺害的恐怖國王。

      為了阻止國王的惡行，她在一千零一個夜晚中，不斷地編織著國王喜歡的故事。

      取自戲碼『一千零一夜』'
