  profile:
    en: He defeats Oda Nobunaga in the Honnoji Incident and rules over the nation
      for a time until he's defeated by Hashiba Hideyoshi in the Battle of Yamazaki.
      The reason why Mitsuhide raised a rebellion is still unknown to this day. From
      "Sengoku Legend."
    ja: 本能寺の変において、主君、織田信長を討ち取り、一時は天下を取ったものの、山崎の戦いで羽柴秀吉に敗れた。何故、光秀が謀反を起こしたのか、真相は未だに闇の中である。演目『戦国英雄伝』より。
