    zh_hant: 明智光秀在本能寺之變中討伐了其君主——織田信長後，雖曾短暫地得到天下，卻於山崎之戰中敗給了羽柴秀吉。光秀為何要謀反？其真相仍埋藏於黑暗之中。取自戲碼『戰國英雄傳』。
