    ja: '第３幕では、復讐に燃えたロミオが一時だけ愛を忘れ

      ジュリエットの近親者へ刃を向けてしまう。

      ふたりの運命は悲劇へと、大きく形を変えていく……

      演目『ロミオとジュリエット』より'
    ko: '제3막에서는 복수에 불타는 로미오가 한순간 사랑을 잊고

      줄리엣의 가까운 친족에게 칼을 들이밀고 만다.

      둘의 운명은 비극으로 크게 형태를 바꾸어간다...

      작품 [로미오와 줄리엣]에서'
    zh_hant: '於第三幕中，羅密歐因燃起了復仇之心，一時之間忘卻了愛，

      並手刃了朱麗葉的親人。

      此舉將兩人的命運導向悲劇，掀起了翻天覆地的改變……

      取自戲碼『羅密歐與朱麗葉』'
