      나오는 격정을 혼신의 힘을 다해 연기했다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』……第6位登場的是帶有金牛座形象的愛城華戀。她全力地演活了那份出自靈魂深處的激情。

      取自戲碼『Star Celebrate～前往起始之日～』'
