  profile:
    en: Abe no Seimei, an onmyoji of immense power, was feared by the people because
      of his birth. Nevertheless, he purged evil with a righteous heart in order to
      protect his country and people. From "YIN-YANG."
    ja: '絶大な力をもつ陰陽師、安倍晴明は人ならざる母から産まれたとして、人々からは恐れられていた。たとえ恐れられようとも国と民を守るため、正義の心で悪を祓う。

      演目『YIN-YANG』より'
    ko: '절대적인 힘을 가진 음양사, 아베노 세이메이는 인간이 아닌 존재인 어머니에게서 태어났다는 이유로 두려움의 대상이 되었다. 설령 사람들이
      두려워하더라도 나라와 백성을 지키기 위해 정의로운 마음으로 악을 물리친다.

      작품 [YIN-YANG]에서'
    zh_hant: '安倍晴明是位擁有莫大力量的陰陽師。他的生母非人，因此人們都很畏懼他。但即使被人們敬而遠之，他仍選擇守護國家人民、以正義之心驅邪除惡。

      取自戲碼『YIN-YANG』'
