      always energetic and loud. Her catchphrases include "Non, non" and other foreign
      words.
    ja: 戯曲『スタァライト』に心を奪われ、舞台の道を目指した舞台少女。いつも元気で声も大きめ。「ノンノンだよ」など、なぜかたまに横文字混じりで話すのが癖。
