      Together with the knights of the round table, Arthur forged ahead valiantly
      through countless obstacles as Britain's king.
    ja: アーサー王は騎士たちを鼓舞するように聖剣エクスカリバーを掲げる。ブリテンを統べる王として、苦難溢れる道を前にしても怯まず、円卓の騎士と共に前進し続けるだろう。
    ko: 아서 왕은 기사들을 고무시키기 위해 성검 엑스칼리버를 높이 들었다. 브리튼을 다스리는 왕으로서 고난이 가득한 길 앞에서도 두려워하지
      않고 원탁의 기사와 함께 계속 앞으로 나아갈 것이다.
    zh_hant: 亞瑟王像是要激勵騎士似地舉起了王者之劍。他身為統治不列顛的王，無論眼前的道路有多艱難，都將與圓桌騎士一同向前邁進。
