  personality_id: 2
  profile:
    en: The "Tower" – a machine intelligence inhabiting a spaceship shot from Earth.
      Tasked with delivering the 'Star Girl' to the Moon, the ship is hit and bursts
      into flames. In that moment amid the flames, the "Tower" makes a decision. From
      "Performance Festival" Play - Act 5.
    ja: '『塔』――それは地上より打ち上げられた宇宙船の機械知性。『星の少女』を月に送り届ける最中、船は攻撃を受けて燃え上がる。生と死のはざま、炎の奥で『塔』はある決断をくだす。

      ――『劇フェス』戯曲・第五幕より'
    ko: '[탑]―― 그것은 지상에서 발사된 우주선의 기계지성이다. [별의 소녀]를 달에 보내던 중, 우주선은 공격을 받고 불타오른다. 생과
      사의 갈림길, 불꽃 속에서 [탑]은 어떤 결단을 내린다.

      ――[극페스] 희곡・제5막에서'
    zh_hant: '『塔』――那是從地上發射出的宇宙船之機械知性。在運送『星之少女』前往月亮時，由於艦體受到攻擊而燃燒。在熊熊烈火的生死之隙中，『塔』做出了某個決定。

      ――取自『戲劇慶典』戲碼・第五幕'
