      but that''s not its true nature. It''s a story about the hardships of living
      freely and the charm that lies beyond. From "Carmen."'
    ja: '『カルメン』は相手を翻弄する悪女の物語という面が強いが、本質はそこではない。自由に生きる困難と、その途方もない魅力を伝える物語なのだ。

      演目『カルメン』より'
    ko: '[카르멘]은 상대를 쥐락펴락하는 악녀 이야기라는 면모가 강하지만, 본질은 그것이 아니다. 자유롭게 살아가는 것의 어려움과, 그 흘러넘치는
      매력을 전달하는 이야기다.

      작품 [카르멘]에서'
    zh_hant: '人們普遍認為『卡門』是一個描寫蛇蠍美人把男性玩弄於鼓掌之間的故事，但它的本質並非如此。它想要傳達的是——自由地活著是多麼困難，卻又多麼讓人憧憬。

      取自戲碼『卡門』'
