  profile:
    en: Fighting for the Toyotomi clan in the Siege of Osaka, he held back Tokugawa
      Ieyasu's troops with only a few soldiers. For this feat, he was later called
      'Number one warrior in Japan'. From "Sengoku Legend."
    ja: '大坂の陣において、豊臣方の武将として闘い、天下を目前にした徳川家康を相手に少数の兵であと一歩のところまで追いつめたことから、『日ノ本一の兵』と評された武将。

      演目『戦国英雄伝』より。'
    ko: '오사카 전투에서 도요토미군의 무장으로 활약했으며, 천하통일을 눈앞에 둔 도쿠가와 이에야스를 상대로 소수의 병사만으로 승리 직전까지
      궁지로 몰아붙여 [일본 제일의 강자]라고 평가받는 무장.

      작품 [전국시대 영웅전]에서'
    zh_hant: '以豐臣一方的武將身分出戰大坂之陣，並憑藉少數兵力將即將一統天下的德川家康幾乎逼到走投無路的境地。故被後世評價為『日本第一勇士』。

      取自戲碼『戰國英雄傳』'
