  profile:
    en: Cupid, angel of love, flies in the sky with white wings. His mission is to
      encourage those who are unable to express their feelings. For those who need
      love and courage, he is always on the move. From "Venus & Cupid."
    ja: '白き翼を羽ばたかせ、空を舞う愛の天使キューピッド。その使命は、想いを告げられない人の背中を押すこと。愛と勇気を必要とする者のため、彼は今日も奔走する。

      演目『ヴィーナス＆キューピッド』より'
    ko: '하얀 날개를 퍼덕이며 하늘을 나는 사랑의 천사 큐피드. 큐피드의 사명은 마음을 전하지 못하는 사람들을 격려해 주는 것. 사랑과 용기가
      필요한 이들을 위해 그는 오늘도 분주히 움직인다.

      작품 [비너스 & 큐피드]에서'
    zh_hant: '愛之天使邱比特展開了白色翅膀在空中飛舞。他的使命就是讓沒有勇氣的人鼓起勇氣，向意中人表白。為了那些需要愛與勇氣的人們，他今天也在四處奔走。

      取自戲碼『維納斯＆邱比特』'
