  profile:
    en: '"In any era of any world...the "Lovers" are fated to be torn apart". Mourning
      resonates in the space between time, but at the same time they know. Their feelings
      for each other will overcome any trial. From "Performance Festival" Play - Act
      5.'
    ja: '「どの時代どの世界でも……『恋人』は引き裂かれる運命なのね」

      時の狭間に嘆きが響く。だが同時に知っていた。

      恋する者たちの想いがあらゆる試練を越えてゆくことを。

      ――『劇フェス』戯曲・第五幕より'
    ko: '[어떤 시대, 어떤 세계이건... ''연인''은 갈라놓아질 운명인 거네]

      시간의 틈새에 비탄이 울려 퍼진다. 하지만 동시에 알고 있었다.

      사랑하는 이들의 마음이 모든 시련을 극복해 나간다는 것을.

      ――[극페스] 희곡・제5막에서'
    zh_hant: '「不論身處什麼時代與世界……『戀人』終將迎來分離的命運」

      嘆息聲於時空的夾縫中響起。但我卻也在同時明白，

      墜入情網者的思念將能夠跨越所有試煉。

      ――取自『戲劇慶典』戲碼・第五幕'
