  profile:
    en: 16th Head of the Uesugi clan. One of the best warriors in the Sengoku period,
      his strength led others to call him "God of War" after his death. He lived honorably,
      and never fought for his own desire. From "Sengoku Legend."
    ja: '上杉家１６代当主。

      戦国時代屈指の戦上手であり、そのあまりの強さから後世『軍神』と評された。

      義に生きた武将であり、私利私欲のために戦をすることはなかったという。

      演目『戦国英雄伝』より。'
    ko: '우에스기 가문 16대 당주.

      전국시대에서 손꼽히는 명장으로, 매우 강인하여 후세에 [군신]으로 평가받는다.

      의로움 하나로 살아간 무장으로 사리사욕을 위해 싸우는 일은 없었다고 한다.

      작품 [전국시대 영웅전]에서'
    zh_hant: '上杉家第16代當家。

      他的驍勇善戰不僅在戰國時代首屈一指，他所擁有的強大力量更讓他被後世尊稱為『軍神』。

      他是一名奉大義為人生準則的武將，終其一生不曾為一己私慾而戰。

      取自戲碼『戰國英雄傳』'
