  profile:
    en: Sixth daughter of Count de Jarjayes, she dresses as a man and lives as a soldier.
      Normally intelligent and calm, her sense of justice sometimes sweeps her away
      and leads her to burst of anger. Having realized the affection her childhood
      friend André feels for her, her heart falters. From "Youths - The Rose of Versailles."
    ja: '男装し軍人として生きる、ジャルジェ伯爵家の六女。聡明で冷静沈着だが、正義感が強く激情に流され暴走することも。幼馴染のアンドレからの慕情に気づき、心が揺れる。

      演目『群像【ベルサイユのばら】』より'
    ko: '남장을 하고 군인으로서 살아가는 자르제 백작가의 6녀. 총명하고 냉정하며 침착하나, 정의감이 강하고 격정에 휩쓸려 이성을 잃기도 한다.
      소꿉친구인 앙드레의 모정을 깨닫고 마음이 흔들린다.

      작품 [군상 ''베르사유의 장미'']에서'
    zh_hant: '傑爾吉伯爵家第六個女兒。身穿男裝，以軍人的身分生活著。她聰明、沉著、冷靜且富有正義感，也曾因被情緒左右而失控。當她發現青梅竹馬——安德烈傾心於她時，內心十分動搖。

      取自戲碼『群像【凡爾賽玫瑰】』'
