      dancer to survive. Her elegant and nostalgic dance brings tears to the patrons
      of a cheap tavern. From "Epic of Bravery - Stage of Legends."
    ja: '国と共に王女という身分を失い、生きるために踊り子となった。安酒場に似合わぬ上品な踊りはどことなく郷愁が駆り立てられ、見る者の涙を誘う。

