      사람들을 눈물 나게 만든다.

      작품 [에픽 브레이브스 레전드 스테이지]에서'
    zh_hant: '隨著國家被毀滅，失去了公主身分的她便以跳舞維生。她那與廉價酒吧格格不入的優雅舞蹈滲透著淡淡鄉愁，令見者無不流淚。

