      작품 [닌자전・오니쿠레나이]에서'
    zh_hant: '率領御影忍軍的首領——鬼影雖然形同惡鬼，但同時卻享負盛名。正因為比誰都懂得人的心理，他才會這麼善於操縱人心吧。

