  profile:
    en: Verdandi, the second of the three goddesses of destiny who reside in the city's
      clock tower, is the goddess of the present. She may look like a maverick, but
      she also has a tender side that cares for the past and future. From "Circle
      of the Norns."
    ja: '街の時計台に宿る、運命の三女神の次女であるヴェルダンディは、現在を司る女神。破天荒に見えるが、なによりも過去と未来を意識する心優しい一面も持つ。

