      the Round Table. He sets out on a quest to save King Arthur with his sworn friend
      Galahad. By doing so, he plans to persuade Mordred, once his savior and now
      turned enemy. From "Holy Grail's Guidance."
    ja: 'パーシヴァルの槍さばきは円卓の騎士でも随一の実力。彼は盟友ガラハッドと共にアーサー王を救う旅に出る。己の恩人だが敵となったモルドレッドを説得する為に。

      演目『聖杯の導き』より'
    ko: '퍼시벌의 창술은 원탁의 기사들 중에서도 최고의 실력을 자랑한다. 그는 맹우 갤러해드와 함께 아서 왕을 구하기 위한 여행을 떠난다.
      자신의 은인이지만 적이 된 모드레드를 설득하기 위해.

      작품 [성배의 인도]에서'
    zh_hant: '珀西瓦里的槍法在圓桌騎士中擁有數一數二的實力。他為了說服如今成為敵人的昔日恩人莫德雷德，而與盟友加拉哈德一同踏上拯救亞瑟王的旅程。

      取自戲碼『聖杯的指引』'
