  profile:
    en: And thus "Star Girl" goes to the promised paradise after many encounters,
      farewells—to arrive to the truth, and the stage. "This is the world."—the last
      curtain rises when the voice echoes from the cosmos. From "Performance Festival"
      Play - Act 6.
    ja: 'そして『星の少女』は楽園に至る。

      ここまでの道程、様々な出会いと別れ、たどり着いた真実と、舞台。

      「ここが、世界だ」宙に響くその声に、最後の幕が上がる。

      ――『劇フェス』戯曲・第六幕より'
    ko: '그리고 [별의 소녀]는 낙원에 도착한다.

      지금까지의 여정, 여러 만남들과 작별하고 도달한 진실과 무대.

      [여기가 세계다] 우주에 울려퍼지는 그 목소리에 마지막 막이 오른다.

      ――[극페스] 희곡 제6막에서'
    zh_hant: '而後，『星之少女』抵達了樂園。

      路程中歷經了各式各樣的相遇與離別，最終抵達真實與舞台。

      「這裡是世界」伴隨著空中響起的話語，最終帷幕即將升起。

      ――取自『戲劇慶典』戲碼・第六幕'
