  profile:
    en: 19th Head of the Kai Takeda clan. Known as the "Tiger of Kai" for his strategic
      prowess, he led his cavalry to several fronts. He fought against Uesugi Kenshin
      for 12 years in what became known as the Battles of Kawanakajima. From "Sengoku
      Legend."
    ja: '甲斐武田家１９代当主。

      『甲斐の虎』の異名をもつ稀代の軍略家として知られ、戦国最強の騎馬隊を率い各地を転戦した。

      上杉謙信とは１２年に及ぶ川中島の戦いを繰り広げた。

      演目『戦国英雄伝』より。'
    ko: '카이 타케다 가문 19대 당주.

      [카이의 호랑이]라는 별명을 가진 희대의 전략가로 알려졌으며, 전국시대 최강의 기마대를 이끌고 각지를 전전했다.

      우에스기 겐신과는 12년에 걸쳐 카와나카지마 전투를 벌였다.

      작품 [전국시대 영웅전]에서.'
    zh_hant: '甲斐武田家第19代當家。

      擁有『甲斐之虎』這個別稱，因其舉世無雙的軍師身分聞名，曾率領著戰國最強的騎馬隊征戰各地。

      更曾與上衫謙信展開過長達12年的川中島之戰。

      取自戲碼『戰國英雄傳』'
