  profile:
    en: Oscar's childhood friend and aide. He loses sight in his left eye to save
      her, and initially suffers for his unrequited love. Eventually their love becomes
      mutual. From "Youths - The Rose of Versailles."
    ja: 'オスカルの幼馴染であり、従卒。オスカルを救うため左眼を失明してしまう。オスカルへの身分違いの恋に苦しむが、やがて相思相愛となる。

      演目『群像【ベルサイユのばら】』より'
    ko: '오스칼의 소꿉친구이자 따라다니는 병사. 오스칼을 구하다 왼쪽 눈이 실명된다. 오스칼을 향한 자신의 잘못된 사랑에 괴로워하지만 이윽고
      서로 사랑하게 된다.

      작품 [군상 ''베르사유의 장미'']에서'
    zh_hant: '奧斯卡的青梅竹馬兼隨從。曾為了救奧斯卡而導致左眼失明。因愛上與自己的身分有雲泥之別的奧斯卡而獨自懊惱，但最終還是跟奧斯卡有情人終成眷屬。

      取自戲碼『群像【凡爾賽玫瑰】』'
