      elegant smile fool you. If she is offended, she will behead you in an instant.
      From "Alice in Wonderland."
    ja: '楽しそうに兵士とトランプ遊びに興じるハートの女王。だが、決してその優雅な笑顔に気を緩めてはいけない。女王の機嫌を損ねればたちまち首をはねられるからだ。

      演目『不思議の国のアリス』より'
    ko: '병사들과 즐겁게 카드놀이를 하는 하트 여왕. 하지만 결코 그 우아한 미소에 방심해서는 안 된다. 여왕의 기분을 상하게 하면 순식간에
      목이 날아갈 수 있기 때문이다.

      작품 [이상한 나라의 앨리스]에서'
    zh_hant: '紅心皇后正愉快地與士兵們玩著撲克牌。但可別被她優雅的笑容迷惑了。只要稍惹皇后不開心，馬上就會被砍頭。

      取自戲碼『愛麗絲夢遊仙境』'
