  profile:
    en: One of the Knights of the Round Table. A young man whom King Arthur had doted
      on, but it all changed when he lost his beloved Isolde. He became a sad knight
      who swore vengeance on Arthur whom he thought to be the cause of Isolde's death.
      From "The Lost Holy Grail."
    ja: '円卓の騎士のひとり。かつてはアーサー王を敬愛する青年

      だったが、最愛の人イゾルデを失ったことで一変。原因

      とされるアーサーへ復讐を誓う悲しみの騎士となった。

      演目『失われた聖杯』より'
    ko: '원탁의 기사 중 한 명. 한때 아서 왕을 경애하는 청년

      이었으나, 가장 사랑하는 사람 이졸데를 잃고 변했다. 원인

      으로 여겨지는 아서에 대한 복수를 맹세하고 슬픔을 안은 기사가 되었다.

      작품 [잃어버린 성배]에서'
    zh_hant: '圓桌騎士的其中一員。曾經受亞瑟王敬愛的青年，

      但在失去至愛之人伊索德後卻性格大變，

      成為了發誓向亞瑟王復仇的悲傷騎士。

      取自戲碼『失去的聖杯』'
