      of God with his unparalleled love and kindness. From "Paradise Lost."
    ja: 'エデンの園にあるという生命の木を守るラファエルは癒しを司る大天使。人と共に食事を囲み、惜しみなく神の知識を与えた。その無類の愛と優しさによって。

