    ko: '에덴동산에 있다는 생명의 나무를 지키는 라파엘은 치유를 관장하는 대천사. 사람들과 함께 식사를 하며 아낌없이 신의 지식을 나누어주었다.
      타의 추종을 불허하는 사랑과 친절함으로.

      작품 [Paradise Lost]에서'
    zh_hant: '拉斐爾掌管治癒，是保護伊甸園中的生命之樹的大天使。他非常大愛與仁慈，不僅曾與人類共餐，還慷慨地向人們傳授了神的知識。

      取自戲碼『Paradise Lost』'
