  profile:
    en: Top student of her year, she also works as class representative. She opposed
      her parents in order to enter Seisho Music Academy. She loves reading, and has
      memorized a great number of quotes from literary and non-literary figures.
    ja: 学年一の才女で学級委員も務める優等生。両親の反対を押し切って聖翔音楽学園に入学した苦労人。読書が好きで、様々な文豪や偉人の名言を暗記している。
    ko: 학년 최고의 재원으로 반장도 맡은 우등생. 부모님의 반대를 무릅쓰고 세이쇼 음악학교에 입학하는 데 많은 고생을 겪었다. 독서를 좋아하며
      다양한 문호와 위인의 명언을 암기하고 있다.
    zh_hant: 同學年當中成績最好的資優生，同時也擔任班長的職務。不顧雙親反對、歷經千辛萬苦才進入聖翔音樂學園就讀。喜愛閱讀，並熟記各種文豪與偉人的經典名言。
