  profile:
    en: A great general who conquered most of the Chugoku region in one generation.
      Known as the greatest strategist in the Sengoku period, he strategizes to take
      down a large army with a small number of troops and was later called the "God
      of Tactics". From "Sengoku Legend."
    ja: '一代で中国地方の大半を制覇した名将。戦国一の軍略家としても有名であり、少数の兵で大軍を打ち破る謀略を駆使したことから、後世『謀神』と称される。

      演目『戦国英雄伝』より。'
    ko: 당대에 혼슈 서부 지방의 대부분을 제패한 명장. 전국시대 제일의 군략가로도 유명하며, 소수의 병사들로 대군을 물리친 모략을 구사하여
      후세에 [모략의 신]으로 불린다. 작품 [전국시대 영웅전]에서.
    zh_hant: '稱霸了大部分中國地方的一代名將。以戰國頂尖謀將的身分馳名。曾運用計謀，成功以少數兵力戰勝大軍，亦因此被後世稱為『謀神』。

      取自戲碼『戰國英雄傳』。'
