  profile:
    en: Although less experienced than other members, her passion toward baseball
      burns brighter. She suggested a baseball match for the team's sake. From "Baseball
      Girl."
    ja: '野球の経験はほかのメンバーより浅いが、その情熱は誰にも負けないほど燃え上がっている。

      野球対決を提案したのは、何よりもチームのため。

      演目『野球少女』より'
    ko: '다른 멤버보다 야구 경험은 적지만, 열정은 누구에게도 뒤지지 않을 만큼 타오르고 있다.

      야구 대결을 제안한 것은 무엇보다도 팀을 위해서다.

      작품 [야구소녀]에서'
    zh_hant: '雖然她的棒球經驗比其他成員少，但對棒球燃起的熊熊熱情卻不會輸給任何人。

      她之所以會提出棒球對決這個想法，也是為了球隊著想。

      取自戲碼『棒球少女』'
