  profile:
    en: Made fun of by history, she lost her memory and calls herself 'Anya'. While
      she is looking for her past, someone reveals to her that "she is indeed Anastasia".
      From "Anastasia."
    ja: '歴史に翻弄され、記憶を失くしてしまった少女。自身を『アーシャ』と呼び、失った過去を探す日々のなか「君こそがアナスタシア」だと声をかける者がいた。

      演目『アナスタシア』より'
    ko: '역사에 농락당하고 기억을 잃어버린 소녀. 자신을 [아샤]라고 부르고, 잃어버린 과거를 찾아다니는 날들 속에서 [네가 바로 아나스타샤]라고
      말을 걸어준 사람이 있었다.

      작품 [아나스타샤]에서'
    zh_hant: '被歷史玩弄、失去記憶的少女。她把自己命名為『亞莎』，過著尋找失落過去的日子。直至有一天，突然有人對她說：「妳正是安娜塔西亞」。

      取自戲碼『安娜塔西亞』'
