      작품 [라그나로크 ~신들의 황혼~]에서'
    zh_hant: '他是主神奧丁之子，也是位擁有像光芒般耀眼的美貌的神明。他深受眾神萬物所喜愛，但就只有惡作劇之神洛基對他敬而遠之。

