      彼女が立たされたのは、裁判官『正義』と陪審員たちが繰り返す、終わりのない法廷劇だった。

      ――『劇フェス』戯曲・第三幕より'
    ko: '모든 시민이 행복하게 사는 [행복 도시]에 도착해, 죄를 추궁당하는 별의 소녀.

      그녀가 선 곳은 재판관 [정의]와 배심원들이 반복하는 끝없는 법정극이었다.

      ――[극페스] 희곡・제3막에서'
    zh_hant: '在不小心闖入所有市民皆擁有幸福生活的『幸福都市』後，星之少女遭到了判刑。

      她被迫參與了由法官『正義』以及陪審員們不斷上演的、永無止境的法庭劇。

      ――取自『戲劇慶典』戲碼・第三幕'
