      of sadness, but he never fails to smile. Like a growing tree seeks the sun,
      he seeks love. From "Siegfried."
    ja: '愛と恐怖を知らない、勇気ある少年。哀しみに満ちた生い立ちだが、明るい笑顔を絶やさない。陽を求める若木のように、未知なる愛を求めている。

