      the great lion's hunger for life with such intimidation that it leaves everyone
      breathless. From "Star Celebrate - To the First Day."
    ja: '宙で輝く星座たちが、流れ星である『あなた』を『明日』へ連れていく。９番手はしし座イメージの大場なな。命を貪る大獅子を、息が止まるほどの威圧感で演じ上げた。

      『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 아홉 번째 성좌는 사자자리를 이미지한 다이바 나나. 목숨을 탐하는
      황금사자를 숨이 멎을 정도로 위압감 있게 연기했다.

      [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』……第9位登場的是帶有獅子座形象的大場奈奈。她把吃人無數的大獅子演繹得很有威嚴，甚至令人屏息。

      取自戲碼『Star Celebrate～前往起始之日～』'
