    ko: 흉측한 얼굴을 가면으로 가린 [유령(팬텀)]은 아름다운 노랫소리를 가진 젊은 오페라 가수 크리스틴을 사랑한다. 그 연심은 폭주해 끔찍한
      사건을 일으킨다.
    zh_hant: 以假面隱藏著自己醜陋的臉的『怪人魅影』，愛上了擁有美妙歌聲的歌劇歌手克莉絲汀。他對克莉絲汀的愛慕終究失控，並引發起了連串恐怖的事件。
