  profile:
    en: King Arthur's advisor and wizard who possesses prominent magical powers and
      wisdom. Sensing Tristan's plot early on, he learns of his sorrow and feels anguished.
      After much hesitation, he ends up deciding to overlook it. From the play "The
      Lost Holy Grail".
    ja: 'アーサー王の助言者であり、卓越した魔力と知識を持つ

      魔術師。トリスタンの陰謀をいち早く感知するも、彼の

      悲しみを知り苦悩。逡巡の末、黙過してしまう。

      演目『失われた聖杯』より'
    ko: '아서 왕의 조언자이자 탁월한 마력과 지식을 가진

      마술사. 트리스탄의 음모를 일찌감치 알아차리지만 그의

      슬픔을 알고 고뇌한다. 망설임 끝에 그것을 묵과해버린다.

      작품 [잃어버린 성배]에서'
    zh_hant: '輔佐亞瑟王，擁有卓越的魔力與知識的魔術師。

      雖然早就發現崔斯坦的陰謀，卻在知道了他的悲傷後苦惱著。

      在幾番猶豫之下，最後選擇了沉默。

      取自戲碼「失去的聖杯」'
