  profile:
    en: The tower's guiding hand appears before Flora, who has arrived at the truth,
      and together with the goddesses, makes the stars twinkle and sing softly. "Please
      take this... The star that you have wished for." From "100th Seisho Festival
      - Starlight."
    ja: '真実にたどり着いたフローラの前に現れた塔の導き手は、女神たちとともに星をキラめかせ優しく歌う――。『お持ちなさい……あなたの望んだその星を』。

      演目『第１００回聖翔祭 戯曲スタァライト』より'
    ko: '진실에 도달한 플로라 앞에 나타난 탑의 인도자는 여신들과 함께 별을 반짝이며 상냥하게 노래한다――. [가지세요... 당신이 원한 그
      별을].

      작품 [제100회 세이쇼제 희곡 스타라이트]에서'
    zh_hant: '塔之引導者在抵達了真相的芙蘿菈的面前現身，並與眾女神一起柔聲歌唱，讓星星綻放光芒——『請妳帶走……妳所期望的那顆星星吧』。

      取自戲碼『第100屆聖翔祭——戲碼Starlight』'
