  profile:
    en: Holding her master's teaching that "Kung Fu is in the spirit," she defeats
      evil with her ultimate punch mastered through rigorous training! Her powerful
      kung fu performance will thrill the audience. From "Xinyi, Fist of Justice."
    ja: '「功夫は心だ」という老師の教えを胸に、厳しい修行の末に会得した必殺拳で悪を成敗！　迫力ある功夫アクションは観客たちを白熱させる。

      演目『正義の拳士シンイ―』より'
    ko: '[쿵푸는 마음이다]라고 말하는 스승의 가르침을 가슴에 품고 혹독한 수행 끝에 터득한 필살기로 악을 심판한다! 박력 넘치는 쿵푸 액션은
      관객들을 열광케 한다.

      작품 [정의로운 권법가 신이]에서'
    zh_hant: '她一直將師傅的教誨——「功夫是心的呈現」銘記在心，並在經歷嚴苛的修行後，成功以必殺拳法來除邪懲惡！那氣勢十足的功夫武打戲讓觀眾們看得非常亢奮。

      取自戲碼『正義的拳手欣怡』'
