  profile:
    en: Archangel said to be the first created by God, leads the army of angels. He
      appears in various stories and is depicted as being affectionate toward people.
      According to one theory, he and Lucifer are twin brothers. From "Paradise Lost."
    ja: '神によって最初に創られたと言われる、天使軍を率いる大天使。様々な物語に登場し人々への愛情深さを描かれる。一説では、ルシファーとは双子の兄弟とされる。

