    ko: '신에 의해 최초로 창조되었다고 전해지는 천사군을 이끄는 대천사. 다양한 이야기에 등장하며 인간에 대한 애정이 깊은 것으로 묘사된다.
      일설에 따르면 루시퍼와는 쌍둥이 형제라는 이야기도 있다.

      작품 [Paradise Lost]에서'
    zh_hant: '米迦勒是率領天使軍的大天使，據說神所創造的第一位天使便是他。他所登場的故事無數，無一不被描繪為憐愛世人的天使。也有某個說法指出，他與路西法是雙胞胎兄弟。

      取自戲碼『Paradise Lost』'
