  profile:
    en: Author of The Pillow Book, she was a bright and intelligent woman. She celebrated
      life at the court with humorous observations. Having known she would get to
      meet her idol—Murasaki Shikibu—she can't contain her excitement. From "Sei Shonagon
      and Murasaki Shikibu."
    ja: '枕草子の作者で、明るく機知に富んだ女性。

      宮中での生活も、『をかし』と称して謳歌していた。

      憧れの紫式部に会えると知って、胸を高鳴らせている。

      演目『清少納言と紫式部』より'
    ko: '마쿠라노소시의 작가로 밝고 재치 넘치는 여성.

      궁중 생활도 [흥취]라고 칭하며 구가했다.

      동경하는 무라사키 시키부를 만날 수 있다는 사실에 가슴 설레고 있다.

      작품 [세이 쇼나곤과 무라사키 시키부]에서'
    zh_hant: '清少納言是枕草子的作者，是位開朗且機巧靈活的女性。

      她將宮中的生活稱為『明快之美』，並歌頌讚嘆。

      得悉能與仰慕的紫式部見面，她的心情正興奮不已。

      取自戲碼『清少納言與紫式部』。'
