  profile:
    en: 'Son of the Knight of the Round Table Lancelot, his swordsmanship rivals even
      his father''s. On the other hand, his sincerity often leads him to doubt his
      place at the Round Table. From "Holy Grail''s Guidance." '
    ja: '円卓の騎士ランスロットの息子。剣術の腕も確かで父と実力伯仲するほど。一方、誠実な性格ゆえに本当に自分が円卓の騎士に相応しいのか、自信が持てないでいる。

      演目『聖杯の導き』より'
    ko: '원탁의 기사 랜슬롯의 아들. 검술 솜씨도 뛰어나서 아버지와 실력이 비등할 정도. 한편, 성실한 성격 때문에 정말로 자신이 원탁의 기사에
      어울리는지 자신감을 가지지 못하고 있다.

      작품 [성배의 인도]에서'
    zh_hant: '圓桌騎士蘭斯洛特的兒子。其劍術實力雖與父親不相上下，但其腳踏實地的性格也讓他不斷質疑自己是否真的有名列圓桌騎士的資格。

