  profile:
    en: Kogoro Akechi is dressed in a kimono from his years as a student and gets
      into his beloved car. The cases he takes on are complex and bizarre. But there
      is no anxiety on his face. Akechi is the kind of man who gets more passionate
      the more difficult a case is. From "The Fiend with Twenty Faces' Challenge."
    ja: '書生の着物に身を包み、愛車に乗り込む明智小五郎。彼の挑む事件は複雑怪奇。だがその顔に不安はない。難解であるほどに燃える、明智とはそういう男なのだ。

