    ko: '서생의 기모노를 입고 자신이 아끼는 차에 올라타는 아케치 코고로. 그가 임하는 사건은 복잡하고 기괴하다. 그러나 그 얼굴에 불안함은
      보이지 않는다. 어려운 사건일수록 불타오르는 아케치는 그런 남자다.

      작품 [괴인 이십면상의 도전]'
    zh_hant: '書生打扮的明智小五郎正跳上自己的愛車。他要面對的案件複雜離奇，但他的臉上卻沒有絲毫不安。越難解的謎團只會讓他越起勁，明智就是這樣的一個男人。

      取自戲碼『怪人二十面相的挑戰』'
