      演目『Deux JUNO！？　～６月の花嫁たち～』より'
    ko: '명가 [미나즈키]의 아가씨. [결혼은 미나즈키 가문의 미래와 번영을 위해]라고 딱 잘라 말하며, 결혼을 꿈꾸는 소꿉친구 준과 대립한다.

      작품 [Deux JUNO!? ~6월의 신부들~]에서'
    zh_hant: '名門『水無月家』的千金、是位傳統的日本女性。她認為「結婚是為了促進水無月家的繁榮興盛」，與對結婚充滿了美好夢想的兒時玩伴——六月的立場對立。

      取自戲碼『Deux JUNO！？　～6月的新娘們～』'
