  profile:
    en: '"I offer my soul. So please save the Hanged Man." Having accepted the Magician''s
      plea, the Devil makes the contract. The Devil was also curious about someone
      who''d denied God and challenged difficulties. From "Performance Festival" Play
      - Act 1.'
    ja: '「私の魂を捧げる。だから吊られた男を救って欲しい」

      魔術師の申し出を受け入れ、悪魔は契約を結ぶ。

      神を否定し、困難に挑む人の姿を、悪魔もまた見届けたくなったのだ。

      ――『劇フェス』戯曲・第一幕より'
    ko: '[내 영혼을 바치지. 그러니 매달린 사람을 구해줬으면 해]

      마술사의 요청을 받아들여 악마는 계약을 맺는다.

      신을 부정하고 난관에 도전하는 사람의 모습을 악마도 지켜보고 싶어진 것이다.

      ――[극페스] 희곡・제1막에서'
    zh_hant: '「我願意奉獻出我的靈魂，所以請妳務必拯救倒吊人」

      在接受了魔術師的請求後，惡魔與其訂下了契約。

      而他否定神明並勇於挑戰困難的態度，也讓惡魔決定親眼見證這一切直到最後。

      ――取自『戲劇慶典』戲碼・第一幕'
