  profile:
    en: Founder and first shogun of the Tokugawa shogunate. After Toyotomi Hideyoshi's
      death, he wins the Battle of Sekigahara and founds the shogunate in Edo, bringing
      an end to 100 years of civil wars. From "Sengoku Legend."
    ja: '江戸幕府初代征夷大将軍。

      豊臣秀吉没後の関ヶ原の戦いにおいて勝利し、江戸に幕府を開き、応仁の乱以後１００年続いた戦乱の時代を終わらせた。

      演目『戦国英雄伝』より。'
    ko: '에도 막부의 초대 장군.

      도요토미 히데요시가 사망한 후 세키가하라 전투에서 승리하고 에도 막부를 열어 오닌의 난 이후 100년간 이어진 전란의 시대에 종지부를 찍었다.

      작품 [전국시대 영웅전]에서'
    zh_hant: '江戶幕府的初代征夷大將軍。

      他在豐臣秀吉逝世後於關原之戰中取得了勝利，並於江戶開創了幕府，結束了自應仁之亂後持續100年的戰亂時代。

      取自戲碼『戰國英雄傳』'
