  profile:
    en: Author of "The Tale of Genji", she was an intriguing and brilliant woman.
      She described the events and subtle workings of human life at the court and
      praised them as exquisite. She says she's only heard of Sei Shonagon, but...
      From "Sei Shonagon and Murasaki Shikibu."
    ja: '『源氏物語』の作者で、妖艶かつ知略に富んだ女性。

      宮中の出来事や人間模様を『あはれ』と称し、綴った。

      清少納言のことは「名だけ知っている」というが……？

      演目『清少納言と紫式部』より'
    ko: '[겐지 이야기]의 작가로, 요염하고 지략이 풍부한 여성이다.

      궁중의 사건과 인간상을 [정취]라고 칭하며 글로 썼다.

      세이 쇼나곤에 대해서는 [이름만 안다]고 하는데...?

      작품 [세이 쇼나곤과 무라사키 시키부]에서'
    zh_hant: '紫式部是『源氏物語』的作者，是位妖艷且足智多謀的女性。

      她將宮中的經歷與錯綜複雜的人際關係稱為『物哀之美』，並細膩描寫。

      關於清少納言，她說自己「只聽過她的名字」，但是……

      取自戲碼『清少納言與紫式部』。'
