      union, he finally came to understand them. From "The Sea God's Villa."
    ja: '海を統治する海神、公子。神であるがゆえに人間が持つ表裏、愛憎を理解できなかったが、愛しい美女への憎しみでこれを知り、結ばれた。

      特別演目『海神別荘』より'
    ko: '바다를 통치하는 해신의 계승자. 신이기 때문에 인간이 가진 양면성, 사랑과 증오를 이해하지 못했지만 사랑하는 미녀에 대한 증오를 통해
