      특별 작품 [해신별장]에서'
    zh_hant: '他是統治大海的海神的繼承者。身為神明，他曾經無法理解人類的表裡與愛恨。直至他對美女由愛生恨，他才終於明白人類的愛恨並與美女共結連理。

      取自戲碼『海神別莊』'
