  profile:
    en: The constellations shining in the sky will lead you, shooting star, to tomorrow.
      In tenth position is Kaoruko Hanayagi who embodies the constellation of Virgo.
      She portrays the innocent and greedy maiden with a high degree of empathy. From
      "Star Celebrate - To the First Day."
    ja: '宙で輝く星座たちが、流れ星である『あなた』を『明日』へ連れていく。１０番手はおとめ座イメージの花柳香子。清楚で強欲な乙女を、高い共感性で演じた。

      演目『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 열 번째 성좌는 처녀자리를 이미지한 하나야기 카오루코. 청초하고 욕심
      많은 처녀를 높은 공감 능력을 발휘해 연기했다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第10位登場的是帶有室女座形象的花柳香子。她以高度的共情能力演活了清純卻貪婪的少女。

      取自戲碼『Star Celebrate～前往起始之日～』'
