  profile:
    en: Mordred knew he was the key to curing Arthur's disease. Should he help his
      former friend, turned enemy? He wagers this decision in a duel with Galahad.
      From "Holy Grail's Guidance."
    ja: 'アーサーの病を治す鍵が自分だと知ったモルドレッド。宿敵であり、かつての仲間の危機に協力すべきか。その判断を彼はガラハッドとの誇りを賭した決闘に委ねた。

      演目『聖杯の導き』より'
    ko: '아서의 병을 낫게 할 열쇠가 자신이라는 것을 안 모드레드. 숙적이자 한때 동료였던 이의 위기에 협력해야만 하는가. 그는 판단을 갤러해드와의
      긍지를 건 결투에 맡겼다.

      작품 [성배의 인도]에서'
    zh_hant: '深知亞瑟王能否痊癒的關鍵即是自己的莫德雷德，在猶豫是否該幫助曾是昔日夥伴的宿敵時，他決意用與加拉哈德之間賭上榮耀的決鬥來做出最後的選擇。

      取自戲碼『聖杯的指引』'
