  profile:
    en: A peddler who sells items wherever the heroes go, dreaming of having the world's
      best store. Even when the world is once again enveloped in darkness, his vitality
      remains strong. From "Epic of Bravery - Original Stage."
    ja: '世界一の店を夢見て、勇者の往く先々でアイテムを売る行商人。世界が再び闇に包まれても、そのバイタリティは陰ることがない。

      演目『エピックブレイブス・オリジナルステージ』より'
    ko: '세계 최고의 가게를 꿈꾸며 용사들이 가는 곳마다 물건을 파는 행상인. 세상이 다시 어둠에 휩싸여도 그 활력은 식지 않는다.

      작품 [에픽 브레이브스 오리지널 스테이지]에서'
    zh_hant: '在勇者途經的城鎮沿路售賣道具的旅行商人，夢想是『擁有世界第一的商店』。即使世界再度被黑暗壟罩，也絲毫不影響她要勇敢追夢的活力。

      取自戲碼『史詩勇者Epic Braves・原創舞台』'
