  profile:
    en: The defeat of the Shinsengumi is inevitable in the face of the attack from
      the new government. Despite this, Hijikata's head is clear as dawn. His strong
      conviction pushes him to his final battle. From "Shinsengumi Rinpuden."
    ja: '新政府軍の猛攻に新選組の敗北はもはや必定となった。だが、土方の顔はこの朝日のように一点の曇りもない。貫く誠の意志が、最期の戦場へ立つ彼の背中を押す。

      演目『新選組凛風伝』より'
    ko: '신정부군의 맹렬한 공격 앞에 신선조의 패배는 이제 확실해졌다. 하지만 히지카타의 얼굴은 이 아침해처럼 밝기만 하다. 관철하려는 참된
      의지가 마지막 전장에 서는 그를 격려한다.

      작품 [신선조 린풍전]에서'
    zh_hant: '面對新政府軍的猛烈攻勢，新選組的敗北幾乎已成定局。然而，土方的表情卻猶如這朝陽般沒有半點陰霾。貫徹忠誠的意志正驅使著他前往最後的戰場。

      取自戲碼『新選組凜風傳』'
