  profile:
    en: A flash that lights up the sea of stars. The war between the Moon and the
      Earth was coming to an end. "Did the young die happy? Where will these souls
      depart to? Only the stars were listening to these questions. From "Performance
      Festival" Play - Act 5.
    ja: '星の海に爆ぜる閃光。月と地球の戦争は終わりつつあった。

      「若者たちは満たされて死んでいったのか？　この魂たちは何処に逝くのか？」　

      星だけが、その問いを聞いていた。

      ――『劇フェス』戯曲・第五幕より'
    ko: '별의 바다에 터져나가는 섬광. 달과 지구의 전쟁은 끝나가고 있었다.

      [젊은이들은 만족하며 죽어갔는가? 이 영혼들은 어디로 떠나는가?]

      별만이 그 물음을 듣고 있었다.

      ――[극페스] 희곡・제5막에서'
    zh_hant: '於星之海中爆裂的閃光，昭示著月亮與地球的戰爭正在邁向終結。

      「年輕人們是否在獲得了滿足後才死去？他們的靈魂又會邁向何方呢？」

      只有星星們傾聽了這個疑問。

      ――取自『戲劇慶典』戲碼・第五幕'
