      Department. After its disbandment, she has faced her own immaturity. Since then,
      she burns every time she's on stage.
    ja: 凛明館女学校演劇科の再興を目指し、生まれ変わった舞台少女。演劇科の廃科を経て、自らの甘さと向き合う。身を燃やし尽くす想いで全力で舞台に臨む。
    ko: 린메이칸 여학교 연극과의 재흥을 목표로 다시 태어난 무대소녀. 연극과 폐지를 겪고 자신의 안이함과 마주한다. 한 몸 불사를 각오로 온
      힘을 다해 무대에 임한다.
    zh_hant: 以復興凜明館女子學校戲劇科為目標並重獲新生的舞台少女。經歷戲劇科被廢科一事後，她重新審視了自己的天真，並懷著不惜將一生燃燒殆盡的意志、以全力君臨舞台。
