  profile:
    en: A pale light shines cold in the palace of the Underworld. When she was brought
      here by Hades, Persephone felt confused, but now she feels at rest when seeing
      this cold and gentle light. From "Orpheus's Melody."
    ja: '冥府の宮殿に冷たく射す青白い光。ハデスによって冥府へ連れて来られた当初は困惑していたが、今では冷たくも優しいこの光こそ彼女に安息を与えている。

      演目『オルフェウスの調べ』より'
    ko: '저승의 궁전을 차갑게 비추는 창백한 빛. 하데스에 의해 저승으로 끌려온 당초에는 곤혹스러웠으나, 지금은 차갑지만 상냥한 이 빛이야말로
      그녀에게 안식을 가져다준다.

      작품 [오르페우스의 멜로디]에서'
    zh_hant: '一道蒼白色的光冰冷地劃過冥府宮殿。起初被哈帝斯帶到冥府時，她曾感到非常困惑，但現在那道冰冷卻溫柔的光卻讓她得到了安寧。

      取自戲碼『奧菲斯的旋律』'
