  profile:
    en: Dreadful witch who lures Hansel and Gretel. She awaits patiently in her house
      made of sweets, and once the prey is trapped, she won't let it escape as long
      as she lives. From "Hansel and Gretel."
    ja: 'ヘンゼルとグレーテルを誘い込む、恐ろしい魔女。お菓子の家でじっと待ち続け、ひとたび獲物が罠にかかると、命が尽きるまで逃がさない。

      演目『ヘンゼルとグレーテル』より'
    ko: '헨젤과 그레텔을 유혹하는 무서운 마녀. 과자 집에서 가만히 기다리다가 일단 사냥감이 덫에 걸리면 목숨이 다할 때까지 놔주지 않는다.

      작품 [헨젤과 그레텔]에서'
    zh_hant: '引誘漢賽爾與葛麗特的元兇、恐怖的魔女。她一直在糖果屋裡默默等待獵物。一旦落入她的陷阱，便直到死亡都無法逃出她的手掌心。

      取自戲碼『糖果屋』'
