  profile:
    en: Bullied by children when in her turtle form, Taro rescued her. She invites
      him to Ryugu-jo to repay him for his kindness. There she falls in love with
      him and wishes to be with him. From "Urashima Taro - Rinmeikan Version."
    ja: '亀の姿で子供たちにいじめられていたところを太郎に助けられ、お礼に竜宮城へ招待しもてなす。太郎に恋をしており、想いの成就を願う。

      演目『凛明館版・浦島太郎』より'
    ko: '거북이의 모습으로 아이들에게 괴롭힘을 당하고 있던 찰나 타로가 도와주고, 그 답례로 용궁에 초대하여 대접한다. 타로를 사랑하고 있으며
      이 사랑이 이뤄지기를 바라고 있다.

      작품 [린메이칸판・우라시마 타로]에서'
    zh_hant: '太郎在乙姬化為海龜、被孩子們欺負時拯救了她。為了報恩，她把太郎招待到龍宮城裡享樂。不久後她愛上了太郎，並默默祈求這段戀情會開花結果。

      取自戲碼『凜明館版・浦島太郎』'
