  profile:
    en: The constellations shining in the sky will lead you, shooting star, to tomorrow.
      In fourth position is Tamao Tomoe who embodies the constellation of Pisces.
      She portrays motherly love with infinite mercy and danger. From "Star Celebrate
      - To the First Day."
    ja: '宙で輝く星座たちが流れ星である『あなた』を『明日』へ連れていく。４番手は、うお座イメージの巴珠緒。母の愛を、無限の慈悲と危うさで表現した。

      演目『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 네 번째 성좌는 물고기자리를 이미지한 토모에 타마오. 어머니의 사랑을
      무한한 자비와 위태로움으로 표현했다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第4位登場的是帶有雙魚座形象的巴珠緒。她以無盡的慈悲與擔憂來演活了母愛。

      取自戲碼『Star Celebrate～前往起始之日～』'
