  profile:
    en: The Shinsengumi led by Kondo Isami enter Ikedaya, where the loyalists are
      hidden. Despite the number of enemies, Kondo Isami doesn't hesitate. His heart
      is filled with loyalty for the shogunate. From "Shinsengumi Rinpuden."
    ja: '近藤勇率いる新選組は倒幕の志士が潜む池田屋へ乗り込んだ。

      敵の数は新選組の数倍。だが近藤は臆しない。

