      演目『新選組凛風伝』より'
    ko: '콘도 이사미가 이끄는 신선조는 막부를 타도하려는 지사들이 숨은 이케다야로 돌입했다.

      신선조의 몇 배나 되는 적들. 하지만 콘도는 겁먹지 않는다.

      막부를 지키는 충성심이 그를 떨쳐 일으킨 것이다.

      작품 [신선조 린풍전]에서'
    zh_hant: '近藤勇率領著新選組攻進了倒幕派志士們所潛伏的池田屋。

      雖然敵人的數量多出新選組數倍，但近藤卻毫無怯意。

      為了守護幕府而飄揚的「誠之心」使他奮勇而起。

      取自戲碼『新選組凜風傳』'
