  personality_id: 5
  profile:
    en: Cerberus is a terrifying three-headed monster standing at the entrance to
      the underworld. The oldest head has big fangs, the second oldest has sharp eyes,
      and the youngest has...a sparkling smile that waits for delicious cookies. From
      "Rerun - Orpheus's Melody."
    ja: 'ケルベロスは冥府の入口に立つ三つ首の恐ろしい怪物。長男は大きな牙、次男は鋭利な眼光、そして三男は笑顔をキラめかせ……美味しいクッキーを待っている。

      演目『再演・オルフェウスの調べ』より'
    ko: '케르베로스는 저승의 입구에 서있는 목이 세 개 달린 무시무시한 괴물이다. 첫째는 커다란 엄니를, 둘째는 날카로운 안광을, 그리고 셋째는
      반짝이는 미소를 지으며... 맛있는 쿠키를 기다리고 있다.

