  profile:
    en: A shadow that lurks in the old capital. Having learned of the whereabouts
      of the loyalists trying to overthrow the Shogunate, Nagakura heads to the location.
      From "Shinsengumi Rinpuden."
    ja: '京の都で暗躍する影。

      幕府を転覆させんとする討幕派の志士たちが集う情報を得た永倉たちは現地へと赴いた。

