  profile:
    en: No verdict came out today either. Fine—the presiding judge decided so. "I
      only do my job as prosecutor," he thought. Until that old man stood on the witness
      stand... From "Performance Festival" Play - Act 3.
    ja: '今日もまた判決が出なかった。

      構わない、裁判長がそう決めたのだから。

      「私は検事としての職務を全うするのみ」

      彼はそう思っていた。あの老人が証人台に立つまでは。

      ――『劇フェス』戯曲・第三幕より'
    ko: '오늘도 또 판결이 나지 않았다.

      상관없다, 재판장이 그렇게 정한 거니까.

      [나는 검사로서의 직무를 완수할 뿐]

      그는 그렇게 생각하고 있었다. 그 노인이 증인대에 서기 전까지는.

      ――[극페스] 희곡 제3막에서'
    zh_hant: '法官今日依舊沒有做出判決。

      不過無所謂，因為那就是法官的決定。

      「我只需貫徹自己身為檢察官的職責即可」

      他一直都是這麼認為的。

      直到那位老人站上證人台。

      ――取自『戲劇慶典』戲碼・第三幕'
