      tower, is the goddess of the past. A compassionate goddess, she takes great
      pleasure in being with her sisters. From "Circle of the Norns."
    ja: '街の時計台に宿る、運命の三女神の長女であるウルドは過去を司る女神。慈悲深い性格で、妹たちと共に在ることが至上の喜び。

      演目『円環のノルン』より'
    ko: '도시의 시계탑에 깃든 운명의 세 여신 중 첫째인 울드는 과거를 관장하는 여신이다. 자비로운 성격으로 동생들과 함께 있는 것을 최고의
      기쁨으로 여긴다.

      작품 [원환의 노른]에서'
    zh_hant: '城鎮的鐘樓裡寄宿著命運三女神，其中大女兒——烏爾德是掌管過去的女神。她擁有慈悲憫人的胸懷，對她來說，與妹妹們共處的時光便是至高無上的喜悅。

      取自戲碼『圓環之諾倫』'
