      into the Land of the Dead to find his beloved wife Eurydice. From "Orpheus's
      Melody."
    ja: '冥王ハデスの治める冥府へと降り立ったオルフェウス。臆しながらも、不気味な死の国の中を突き進んでいく。全ては愛しの妻エウリュディケーを助ける、その為に。

