      작품 [오르페우스의 멜로디]에서'
    zh_hant: '奧菲斯來到了由冥王哈帝斯所統治的冥府。即使感到畏懼，他仍在詭譎的死亡國度中拼命前行。而這一切都是為了拯救他最愛的妻子――歐利蒂絲。

