  profile:
    en: An epidemic that has spread fear among the people – a man learns medicine
      to face this enemy. However, the enemy isn't only the disease. The High Priestess
      admonishes him that "only God can save mankind." From "Performance Festival"
      Play - Act 1.
    ja: '人々を恐怖に落とし入れる流行病。男は医術を学びこの恐るべき敵に立ちむかう。

      だが敵は病だけではなかった。

      「人を救うは神の奇跡のみ」と女教皇が騎士団を差し向けたのだ。

      ――『劇フェス』戯曲・第一幕より'
    ko: '사람들을 공포에 빠뜨리는 돌림병. 남자는 의술을 배워 이 무서운 적에 맞선다.

      하지만 적은 병뿐만이 아니었다.

      [인간을 구하는 것은 신의 기적뿐]이라며 여교황이 기사단을 보낸 것이다.

      ――[극페스] 희곡・제1막에서'
    zh_hant: '使人們陷入恐慌的傳染病正在蔓延。但男人卻憑藉自己的醫術、挺身對抗這令人恐懼的敵人。然而他所面對的敵人卻並非僅有疾病。堅信能拯救世人的唯有神之奇蹟的女教皇向騎士團下達了追捕男人的命令。

      ——取自『戲劇慶典』戲碼・第一幕'
