      loyalists. His taciturn and action-before-words behavior attracted those around
      him. From "Shinsengumi Rinpuden."
    ja: '近藤の窮地に駆けつけ、颯爽と倒幕の志士を屠る斎藤。不言実行、寡黙な彼の行動は言葉よりも周囲を惹きつける。

      演目『新選組凛風伝』より'
    ko: '궁지에 몰린 콘도를 도우러 달려가  막부를 타도하려는 지사들을 용감하게 쳐부수는 사이토. 말보다 실천, 과묵한 그의 행동은 말보다
      주위 사람들을 매료시킨다.

      작품[신선조 린풍전]에서'
    zh_hant: '齋藤曾在近藤陷入險境時及時趕到，並俐落地打敗倒幕派志士。他雖是沉默寡言的行動派，但他的行動卻比任何話語都要吸引人心。

      取自戲碼『新選組凜風傳』'
