  profile:
    en: Blessed with an athletic body, she never fails to charm the audience with
      her powerful action scenes. She used to be shy and live in the shadow of Tamao,
      but having gained much experience, she now strives to create the perfect stage
      with her friends.
    ja: '恵まれた体躯を持ち、迫力のある殺陣で観客を魅了する舞台少女。

      かつては引っ込み思案で舞台でも珠緒の背中ばかり追っていたが、様々な舞台を経て成長し、仲間たちと理想の舞台へ邁進する。'
    ko: '축복받은 체구를 가졌으며, 박력 있는 결투 장면으로 관객을 매료하는 무대소녀.

      한때는 소극적인 성격으로 무대에서도 타마오 뒤만 쫓아다녔지만, 다양한 무대 경험을 통해 성장하고, 동료들과 이상의 무대에 매진한다.'
    zh_hant: '是一名擁有優美體態的舞台少女，她總是以充滿魄力的武打戲使觀眾們為她著迷。

      過去的她個性內向，在舞台上也總是追著珠緒的背影前進，但在歷經各式各樣的舞台演出並獲得成長後，她開始與夥伴們朝著理想中的舞台邁進。'
