  profile:
    en: King Hades rules over the trial of the dead in the palace of the Underworld.
      His ruthless gaze shakes the inhabitants of the Underworld. He never makes allowances
      and his judgment is always strict and fair. From "Orpheus's Melody."
    ja: '冥府の宮殿にて、死者の裁判に臨む冥王ハデス。冷酷で凍てつくその眼差しは地獄の亡者を震撼させる。彼の審判に酌量は一切なく、常に厳格公正に下される。

      演目『オルフェウスの調べ』より'
    ko: '저승의 궁전에서 사자의 재판에 임하는 명왕 하데스. 냉혹하고 얼어붙은 눈길은 지옥의 망자들을 벌벌 떨게 만든다. 그의 심판은 일체
      사정을 봐주지 않으며, 항상 엄격하고 공정하게 이루어진다.

      작품 [오르페우스의 멜로디]에서'
