  profile:
    en: Romeo quietly stares at Juliet. His eyes are honest and single-minded. There
      is only pure and intense passion—no calculation, no bargaining. Only he can
      reach true love. From "Romeo and Juliet."
    ja: '静かにジュリエットを見つめるロミオ。ただひたすらにまっすぐな瞳。そこに秘めるは純粋にして激しい情熱。打算も駆け引きもない。彼だけが辿り着く真実の愛。

      演目『ロミオとジュリエット』より'
    ko: '조용히 줄리엣을 바라보는 로미오. 오로지 똑바로 응시하는 눈동자. 거기에 숨겨진 것은 순수하고 격렬한 열정. 계산도 흥정도 없다.
      그만이 도달할 수 있는 진실한 사랑.

      작품 [로미오와 줄리엣]에서'
    zh_hant: '羅密歐靜靜地凝視著朱麗葉。他那直率眼神中蘊藏著純粹且激烈的熱情。這份沒有任何詭計與心機的愛，是只有他才能抵達的、真實的愛。

      取自戲碼『羅密歐與朱麗葉』'
