  profile:
    en: The constellations shining in the sky will lead you, shooting star, to tomorrow.
      In eleventh position is Yuyuko Tanaka who embodies the constellation of Libra.
      She portrays the goddess of justice with her unique and original point of view.
      From "Star Celebrate - To the First Day."
    ja: '宙で輝く星座たちが流れ星である『あなた』を『明日』へ連れていく。１１番手はてんびん座イメージの田中ゆゆ子。彼女らしい奇抜な視点で、正義の女神を演じあげた。

      演目『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 열한 번째 성좌는 천칭자리를 이미지한 타나카 유유코. 그녀 특유의
      기발한 시점으로 정의의 여신을 연기했다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第11位登場的是帶有天秤座形象的田中悠悠子。她以自身獨特的觀點，演活了正義的女神。

      取自戲碼『Star Celebrate～前往起始之日～』'
