  profile:
    en: Easygoing and seemingly always taking a step back to reflect on the situation,
      she secretly burns with an ardent passion. Devotes herself to protecting the
      Performance Association.
    ja: 飄々として、どんなときも一歩引いて物事を見ているようだが、内に秘めた情熱を誰よりも赤々と燃やしている舞台少女。同好会というかけがえのない場所を守るため、日々研鑽を続けている。
    ko: 종잡을 수 없고 어떤 때라도 무엇이든 한걸음 물러서서 보는 것처럼 보이지만 내면에 감춰진 열정을 누구보다도 활활 태우고 있는 무대소녀.
      동호회라는 무엇과도 바꿀 수 없는 장소를 지키기 위해 나날이 실력을 갈고닦고 있다.
    zh_hant: 她是一位看似飄忽不定，且面對任何情況都會退後一步觀看全局的舞台少女，但她的內心其實隱藏著比任何人都赤誠的熱情。為了守護同好會這個無可取代的容身之處，她正日以繼夜地鑽研著各種技巧。
