  profile:
    en: Eurydice sits in loneliness, imprisoned in a cell in the Underworld. Yet,
      she doesn't despair, and knowing her husband will come to rescue her, she awaits
      praying. From "Orpheus's Melody."
    ja: '冥府の牢に囚われ孤独に座して待つエウリュディケー。しかし、その顔に絶望はない。愛する夫は必ず来てくれる。確信に満ちた想いを胸に、祈りを捧げ続ける。

      演目『オルフェウスの調べ』より'
    ko: '저승의 감옥에 갇혀 고독하게 앉아 기다리는 에우리디케. 허나 그 얼굴에 절망은 없다. 사랑하는 남편은 반드시 와 줄 거야. 그런 확신에
      찬 생각을 가슴에 안고 계속 기도를 드린다.

      작품 [오르페우스의 멜로디]에서'
    zh_hant: '被囚禁於冥府牢獄的歐利蒂絲正孤獨地坐等著，但她的表情並沒有一絲絕望。她相信她深愛的丈夫一定會來拯救她。懷抱著這份確信的她正祈禱著丈夫的平安。

      取自戲碼『奧菲斯的旋律』'
