      She goes to visit her sick grandmother, but there she finds... From "Little
      Red Riding Hood."
    ja: 'おばあちゃんの作った赤ずきんをいつも被った、天真爛漫な可愛らしい女の子。病気のおばあちゃんのお見舞いに行くが、そこにいたのは……？

