  profile:
    en: Dr. Jekyll prowls the dark night. No, it's his hidden persona, Hyde—a vicious
      man who wields a knife without hesitation and goes on a rampage. The smile on
      his face is as twisted as the Devil himself. From "Dr. Jekyll and Mr. Hyde."
    ja: '闇夜を徘徊するジキル博士。いや、その裏人格ハイド。躊躇なくナイフを振り回し暴れる凶悪極まりない男だ。その口元に浮かぶ笑みは、悪魔のごとく歪んでいる。

      演目『ジキル博士とハイド氏』より'
    ko: '어두운 밤을 배회하는 지킬 박사. 정확히는 그 숨겨진 인격 하이드. 주저 없이 나이프를 휘두르며 난동을 부리는 흉악하기 그지없는 남자다.
      그 입가에 떠오른 미소는 악마처럼 일그러져 있다.

      작품 [지킬 박사와 하이드]에서'
    zh_hant: '徘徊在暗夜中的不是化身博士，而是他的另一個人格——海德。他性格殘暴至極，甚至能毫無心理障礙地揮舞刀刃。此刻他臉上正掛著惡魔般的猙獰笑容。

      取自戲碼『變身怪醫』'
