  profile:
    en: A Wandering sharpshooter who used to be famous for his skills, but couldn't
      shoot after a certain incident. After that, people started calling him "Kid".
      From "Golden Gunfight."
    ja: '街から街へ流れる流浪のガンマン。射撃の名手だったが、

      とある出来事がきっかけで銃が撃てなくなり、以来

      『キッド（坊や）』と呼ばれている。

      演目『黄金の決斗』より'
    ko: '거리를 유랑하는 떠돌이 총잡이. 사격의 명수였으나

      어떤 사건을 계기로 총을 쏘지 못하게 되어, 이후

      [키드(어린아이)]로 불리고 있다.

      작품 [황금의 결투]에서'
    zh_hant: '流浪於各個城鎮的槍手。

      雖然以神槍手為名，卻因為某個契機而失去了射擊的能力。

      在那之後，周遭的人們便開始以『小夥子』稱呼他。

      取自戲碼『黃金的決鬥』'
