  profile:
    en: The Moon was a vast desert. Is this place where all is dead truly the promised
      Paradise? When Star Girl despairs at the end of her journey, a voice calls "Welcome
      home". From "Performance Festival" Play - Act 6.
    ja: '月面は茫洋たる砂漠だった。ここが約束の楽園なのか？　全て死に絶えたこの場所が？旅の果てに辿り着いた『星の少女』が嘆いたその時――「おかえり」と呼ぶ声がした。

      ――『劇フェス』戯曲・第六幕より'
    ko: '월면은 망망한 사막이었다. 이곳이 약속의 낙원인가? 모든 것이 절멸해버린 이 장소가? 여행의 마지막 목적지에 도달한 [별의 소녀]가
      탄식한 바로 그때―― [어서 와]라고 부르는 소리가 들렸다.

      ――[극페스] 희곡・제6막에서'
    zh_hant: '月面只是一片浩瀚沙漠。這個毫無生命氣息的地方，就是約定的樂園嗎？當『星之少女』為旅程最後所抵達的地方而哀嘆之時——傳來了一聲「歡迎回來」。

      取自『戲劇慶典』戲碼・第六幕'
