  profile:
    en: During the fierce battle, White Frontier uses her ultimate skill. Known for
      her sharpshooting, she can detect her enemies' weaknesses and take them down
      with accuracy even in the most difficult situations. From Premium Show "Theater
      Rangers Frontier V."
    ja: '激闘の最中、フロンホワイトの敵に必殺の一撃が炸裂。ホワイトは冷静な射撃の名手。どんなに困難な状況でも敵の弱点を探知し、正確に狙い撃つことが出来るのだ。

      プレミアムショー『歌劇戦隊フロンティアＶ』より'
    ko: '치열한 싸움을 벌이는 중에 프론 화이트의 적에게 필살 일격 작렬. 화이트는 냉정한 사격의 명수. 그 어떤 어려운 상황에서도 적의 약점을
