      포근함에 무서운 거대 전갈은 다른 모습으로 비춰진다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第12位登場的是帶有天蠍座形象的大月艾露露。她以自身的豐富情感，改變了令人畏懼的大蠍子。

      取自戲碼『Star Celebrate～前往起始之日～』'
