  profile:
    en: 'God of lightning and strongest among the Aesir. Rough around the edges, he
      nevertheless walks the path of righteousness. This causes a rift with his close
      friends and leads him to suffer. From "Ragnarok: Twilight of the Gods."'
    ja: 'アース神族一の力を誇る雷神。直情的で粗暴なところがあるが、誰よりも義に厚い。それ故に親友の間で板挟みとなり、苦悩することになる。

      演目『ラグナロク～神々の黄昏～』より'
    ko: '아스 신족 중 제일의 힘을 자랑하는 천둥의 신. 감정적이고 난폭한 면이 있으나 누구보다도 의리가 두텁다. 그로 인해 친구 사이에 끼어
      고뇌하게 된다.

      작품 [라그나로크 ~신들의 황혼~]에서'
    zh_hant: '在亞薩神族中擁有首屈一指的力量並以此為傲的雷神。雖然他性格直率，有時會露出粗獷的一面，但他卻比誰都要重情義。他也因此被夾在兩位好友的中間，並為此而苦惱。

      取自戲碼『眾神的末日～諸神黃昏～』'
