      작품 [이상한 나라의 앨리스]에서'
    zh_hant: '愛麗絲是個好奇心旺盛的少女，某天她追著白兔不小心誤闖進仙境。她在那裡遇見了許多不可思議的人與動物們，還被捲進了某場騷動中。

