    ko: '나눔과 베풂만이 [자선]이 아니다.

      잃어버린 달빛을 찾아 그녀 또한 황야를 내달린다.

      자신을 구해준 [A]를 찾기 위해. 이번에는 자신이 구하기 위해.

      ――[극페스] 희곡 제4막에서'
    zh_hant: '只是不斷地給予與施惠並稱不上是『慈愛』。

      為了尋找失去的月之光輝，她再次踏足荒野。

      『A』曾救濟過自己，這次該輪到自己去拯救『A』了。

      ――取自『戲劇慶典』戲碼・第四幕'
