  profile:
    en: The time for "Judgement" is here. Shaking off the fine days illuminated by
      the glittering glow of the warm moon, they step into the dark wilderness. "Even
      if this decision hurts her—"A". From "Performance Festival" Play - Act 4.
    ja: '『審判』の時は来た。

      あたたかい月の煌めきに照らされた愛しき日々を振り払い、漆黒なる荒野に踏み出す時が。

      「たとえこの決断が彼女を……『A』を傷つけることになっても」

      ――『劇フェス』戯曲・第四幕より'
    ko: '[심판]의 때가 왔다.

      따스한 달의 반짝임에 비추어진 사랑스러운 날들을 떨쳐 버리고 칠흑 같은 황야로 발을 내딛는 때가.

      [설령 이 결단이 그녀를... ''A''를 상처 입히게 되더라도]

      ――[극페스] 희곡 제4막에서'
    zh_hant: '『審判』之時到來了。

      擺脫在溫暖的月亮照耀下讓人眷戀的往日、踏向漆黑荒野之時終於來臨。

      「就算這個抉擇會傷害到她……傷害到『A』」

      ――取自『戲劇慶典』戲碼・第四幕'
