      the hearts of many. A ruthless sharpshooter who won't spare any effort to achieve
      his goals. Lady Catherine loves him like a brother. From "Golden Gunfight."
    ja: '泣く子も黙る、ブロンティア一家の用心棒。

      目的のためには手段を選ばない冷酷無比なガンマンだが、ブロンティア一家の令嬢キャサリンには兄の様に慕われている。

      演目『黄金の決斗』より'
