    zh_hant: '第47特殊獵兵班的班長。他與亞瑟少校一起成立了這個部隊。在某次事件後，他並沒有露出任何反叛意圖，甚至被傳言是個膽小鬼，然而——

      取自戲碼『忠誠侍從』'
