  profile:
    en: The Galactic Empire was formed, and thus the stars were ruled by the "Emperor".
      Still...they rebelled. Not even an absolute ruler could stop them from singing
      of freedom and standing on the stage. From "Performance Festival" Play - Act
      5.
    ja: '恒銀河帝国はここに成り、星々は『皇帝』のものとなった。それでも……それでも彼女たちは反抗する。たとえ相手が絶対支配者であろうとも、自由を歌い、舞台に立つために。

      ――『劇フェス』戯曲・第五幕より'
    ko: '이로써 항은하제국이 세워지고 별들은 [황제]의 것이 되었다. 하지만... 하지만 그녀들은 반항한다. 설령 상대가 절대지배자라 해도
      자유를 노래하며 무대에 서기 위해.

      ――[극페스] 희곡・제5막에서'
    zh_hant: '恆銀河帝國已然成立，繁星也歸『皇帝』所有。即使如此……她們仍要反抗到底。儘管對手是絕對的支配者，她們仍會為了能踏上舞台、高歌自由而戰。

      ——取自『戲劇慶典』戲碼・第五幕'
