    ja: '国民的人気ゲームを題材にした本作。なかでも魔法使いは複雑な生い立ちからなる黒幕的な人気キャラ。姫と勇者の関係を語る時には外せない重要な人物だ。

      演目『エピックブレイブス・レジェンドステージ』より'
    ko: '전국민적인 사랑을 받은 인기 게임을 소재로 한 본 작품. 그중에서도 마법사는 복잡한 사연을 가진 흑막 격의 인기 캐릭터이다. 공주와
      용사의 관계를 이야기할 때 빼놓을 수 없는 중요한 인물이다.

      작품 [에픽 브레이브스 레전드 스테이지]에서'
    zh_hant: '本作以深受國民歡迎的電玩為題材。劇情中的黑幕之一——魔法師，就因其複雜的身世而在戲外極具人氣，也是在描寫公主與勇者的關係時不可或缺的角色。

      取自戲碼『史詩勇者Epic Braves・傳奇舞台』'
