  profile:
    en: The constellations shining in the sky will lead you, shooting star, to tomorrow.
      In eighth position is Akira Yukishiro who embodies the constellation of Cancer.
      The audience is captivated by his strong will to carry on for the sake of his
      friends. From "Star Celebrate - To the First Day."
    ja: '宙で輝く星座たちが、流れ星である『あなた』を『明日』へ連れていく。８番手はかに座イメージの雪代晶。友のためにと貫く強い意志で、観客を魅了した。

      『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 여덟 번째 성좌는 게자리를 이미지한 유키시로 아키라. 친구를 위해
      관철하는 강한 의지로 관객들을 매료시켰다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第8位登場的是帶有巨蟹座形象的雪代晶。那份為情義而犧牲的堅強意志，深深地打動了觀眾。

      取自戲碼『Star Celebrate～前往起始之日～』'
