  profile:
    en: In a city surrounded by the mighty enemy, the Hierophant preaches to the remaining
      citizens. "The strength of believing God's love cannot be squashed by any power."
      However, violence and insanity were close at hand. From "Performance Festival"
      Play - Act 2.
    ja: '強大な敵に包囲された街で法王は残された市民達に教えを説く。

      「神の愛を信じる強さは、いかなる力にも侵すことは出来ない」と。

      だがすぐそこに迫っていた。暴力と理不尽が。

      ――『劇フェス』戯曲・第二幕より'
    ko: '강대한 적에게 포위된 거리에서 교황은 남은 시민들에게 설교한다.

      [그 어떠한 힘도 신의 사랑을 믿는 강함을 범하지 못한다]고.

      하지만 코앞까지 다가와 있었다. 폭력과 불합리가.

      ――[극페스] 희곡・제2막에서'
    zh_hant: '教皇留在被強大敵人所包圍的城鎮裡向殘存的市民們宣揚教義。

      「因信仰神之愛所獲得的強大，是不受任何力量所侵犯的」

      然而暴力與無理，卻已近在眼前。

      ——取自『戲劇慶典』戲碼・第二幕'
