  profile:
    en: Dorothy and her dog Toto have been sent to a faraway land in the east. In
      order to return to her hometown in Kansas, she and her friends go to the Great
      Wizard of Oz. From "The Wonderful Wizard of Oz."
    ja: 'ドロシーは愛犬のトトと共に遠い東の国へ飛ばされてしまった。故郷のカンザスへ戻るため、仲間とともに大魔法使いオズの元へ向かう。

      演目『オズの魔法使い』より'
    ko: '도로시는 반려견 토토와 함께 머나먼 나라로 날아가 버렸다. 고향 캔자스에 돌아가기 위해 동료들과 위대한 마법사 오즈를 찾아 떠난다.

      작품 [오즈의 마법사]에서'
    zh_hant: '桃樂西與愛犬托托一同被龍捲風吹到遠東之國。為了返回故鄉，她與夥伴們一起前往大魔法師奧茲的所在地。

      取自戲碼『綠野仙蹤』'
