  profile:
    en: On a beautiful moonlit night, Seimei opens his mouth while sipping his cup.
      Unusual for him, he tells his own story... ORIGIN is a colorful old tale that
      shows an unknown side of each person. From "YIN-YANG ORIGIN."
    ja: '月の綺麗な夜、杯を傾けながら晴明は口を開く。彼にしては珍しい、自分語り……『ORIGIN』とは、それぞれの人物の知られざる一面を見せる、色鮮やかな昔語り。

      演目『YIN-YANG・ORIGIN』より'
    ko: '달이 아름다운 밤, 잔을 기울이며 세이메이는 입을 연다. 그로서는 드물게도 자신의 이야기를 시작한다... [ORIGIN]이란 각 인물들의
      알려지지 않은 일면을 보여주는 아름답고 생생한 옛날이야기.

      작품 [YIN-YANG ORIGIN]에서'
    zh_hant: '晴明在美麗的月色下與賴光共酌，並罕見地說起了自己的往事……『ORIGIN』，這個故事能讓你看到各個角色鮮為人知的一面，以及鮮明清晰的昔日往事。

      取自戲碼『YIN-YANG・ORIGIN』'
