  profile:
    en: The days of glory are in the past. Among the tedious, unchanging days where
      only lives are lost through war between the stars. Looking up from the desolate
      Moon Empire – the "Empress" waits for someone. From "Performance Festival" Play
      - Act 5.
    ja: '栄耀栄華も今は昔。荒れ果てた月の帝国から見上げる

      星と星の戦争。命だけが消費されてゆく、変化のない退屈な日々の中――「女帝」は誰かを待っていた。

      ――『劇フェス』　戯曲・第五幕より'
    ko: '부귀영화도 이제는 옛일. 황폐해진 달의 제국에서 올려다보는

      별과 별들의 전쟁. 생명만이 소모되어 가는 변화 없는 지루한 나날 속에―[여제]는 누군가를 기다리고 있었다.

      ――[극페스] 희곡・제5막에서'
    zh_hant: '曾經的榮耀與富貴不復存在。在一片荒蕪的月之帝國，

      仰頭能看見星球間的戰爭。生命在一成不變的枯燥光陰中不斷流逝——「女帝」持續等待著某個人。

      ――取自『戲劇慶典』戲碼・第五幕'
