      emotions in a very clear way, and hates things that don't make sense the most.
      From "Loyal Retainer."
    ja: '鬼少尉の異名で恐れられる第４７特殊猟兵班の切り込み隊長。喜怒哀楽がはっきりしている感情家で、筋の通らないことを最も嫌っている。

      演目『ロイヤルリテイナー』より'
    ko: '악마 소위라는 별명으로 공포의 대상인 제47특수부대 돌격대장. 희로애락의 표현이 확실한 감정적인 인물로, 이치에 맞지

