  obtain_route_flags: 0
  party_skill_id: 153
  party_skill_level_id: 2
  party_skill_type: 5
  personality_id: 1
  profile:
    en: A simple and genuine Stage Girl who rushes headlong and is full of energy.
      While she respects Akira, she's also aware that she needs to surpass her. She
      puts her spirit into everything she does, from greeting to taking on challenges.
    ja: '単純明快、猪突猛進、元気溌剌舞台少女。

      晶を尊敬すると同時に越えるべく壁と強く意識している。

      誰より元気に挨拶、返事、感嘆、挑戦！！

      それがメイファン的日常。'
    ko: '단순 명쾌, 저돌 맹진, 원기 발랄한 무대소녀.

      아키라를 존경하면서 동시에 뛰어넘어야 할 벽이라고 강하게 의식하고 있다.

      누구보다도 씩씩하게 인사하고 대답하고 감탄하고 도전한다!!

      그것이 메이팡의 일상.'
    zh_hant: '單純直率、勇往直前、活潑有朝氣的舞台少女。

      美帆雖然很尊敬晶，卻也同時將晶視為自己必須跨越的高牆。

      用比任何人都還要有精神的聲音打招呼、回應、讚嘆並挑戰他人，

      就是美帆的日常生活！'
