  profile:
    en: Defeated by Yorimitsu in a contest of strength at Ashigara Pass, he decides
      to become his follower. He hasn't forgiven Seimei, and is filled with jealousy.
      From "YIN-YANG."
    ja: '足柄峠にて出会った頼光と力比べをして完敗し、以降、頼光を慕い付き従う。晴明に対しては心を許しておらず、嫉妬の感情を抱いている。

      演目『YIN-YANG』より'
    ko: '아시가라 고개에서 만난 요리미츠와 힘을 겨루기를 해 완패한 뒤부터 요리미츠를 동경하며 모신다. 세이메이에 비해서는 마음을 열지 않는
      것에 질투를 느낀다.

      작품 [YIN-YANG]에서'
