  profile:
    en: Act 4 depicts how Romeo and Juliet nearly meet each other. Pressed by her
      imminent marriage to Count Paris, Juliet drinks the poison that will put her
      in a deathlike coma for her beloved Romeo. From "Romeo and Juliet."
    ja: '第４幕では、すれ違うロミオとジュリエットを描く。

      パレス伯爵との結婚を迫られたジュリエットは、追放されたロミオのために、仮死の毒を飲む決意をする。

      演目『ロミオとジュリエット』より'
    ko: '제4막에서는 엇갈리는 로미오와 줄리엣을 그린다.

      파리스 백작과의 결혼을 강요 당한 줄리엣은 추방 당한 로미오를 위해 가사 상태에 빠지는 독을 마시기로 결심한다.

      작품 [로미오와 줄리엣]에서'
    zh_hant: '第四幕描繪了羅密歐與朱麗葉兩人失之交臂的經過。

      朱麗葉即將被迫嫁給帕里斯伯爵。為了被放逐的羅密歐，她決定服下詐死藥水。

      取自戲碼『羅密歐與朱麗葉』'
