  profile:
    en: Her real identity is Fuumi's sick younger sister. Her goal is to overcome
      the hardships of her illness, and stand on the ring with her sister. Her path
      is perilous, but will certainly lead her to her dream. From "Future Pro Wrestling
      2999."
    ja: '素顔はフウミの病弱な妹。つらい投薬やリハビリにも負けずいつか姉と同じリングに立つことを目指していた。その険しい路こそが夢、勝利へと繋がっている。

      演目『Futureプロレスリング２９９９』より'
    ko: 'BLOODY DEVIL의 정체는 후우미의 병약한 여동생이다. 괴로운 투약과 재활 치료를 잘 견디며 언젠가 언니와 같은 링에 서는 것을
      목표로 하고 있다. 그 험난한 길이야말로 꿈과 승리로 이어져있다.

      작품 [Future 프로 레슬링 2999]에서'
    zh_hant: '她其實是霧恩那身體孱弱的妹妹。她一直不畏長期服藥與進行復健，希望有一天能與姊姊站上同一個擂台。正因那是一條艱辛的路，才能肯定路的盡頭便是夢想與勝利。

      取自戲碼『Future摔角擂台2999』'
