  profile:
    en: The constellations shining in the sky will lead you, shooting star, to tomorrow.
      In fifth position is Shiori Yumeoji who embodies tender love toward every sorrow,
      even hatred itself. From "Star Celebrate - To the First Day."
    ja: '宙で輝く星座たちが流れ星である『あなた』を『明日』へ連れていく。５番手は、おひつじ座イメージの夢大路栞。どんな悲しみにも無限の優しさで、憎悪すら愛した。

      演目『スタァセレブレイト～始まりの日へ～』より'
    ko: '우주에서 빛나는 성좌들이 별똥별인 [당신]을 [내일]로 이끈다. 다섯 번째 성좌는 양자리를 이미지한 유메오지 시오리. 어떤 슬픔에도
      무한한 상냥함으로 증오조차 사랑했다.

      작품 [스타 셀리브레이트 ~시작의 날로~]에서'
    zh_hant: '在宇宙中閃耀的星座們將帶領身為流星的『你』前往『明天』。第5位登場的是帶有白羊座形象的夢大路栞。不論過去有多麼可悲、多麼可恨，她都以無限的溫柔去擁抱並愛著一切。

      取自戲碼『Star Celebrate～前往起始之日～』'
