  profile:
    en: Skuld, youngest of the three goddesses of destiny who reside in the city's
      clock tower, is the goddess of the future. Timid and cautious because she sees
      the end of people, she looks to her sisters for emotional support. From "Circle
      of the Norns."
    ja: '街の時計台に宿る、運命の三女神の末妹であるスクルドは、未来を司る女神。人の最期を見る故に、臆病で慎重な性格。姉たちを心の拠り所としているが……

      演目『円環のノルン』より'
    ko: '도시의 시계탑에 깃든 운명의 세 여신 중 막내인 스쿨드는 미래를 관장하는 여신이다. 인간의 최후를 보기 때문에 겁이 많고 신중한 성격이다.
      언니들을 마음의 버팀목으로 삼고 있지만......

      작품 [원환의 노른]에서'
    zh_hant: '城鎮的鐘樓裡寄宿著命運三女神，其中小女兒——詩寇蒂是掌管未來的女神。由於能看見生命的結局，故養成了謹小慎微的性格。她將姊姊們視為自己的心靈支柱，然而……

      取自戲碼『圓環之諾倫』'
