      personality leads him to brood over things, but once he's made up his mind,
      he doesn't stray from the path. From "Loyal Retainer."
    ja: '第４７特殊猟兵班に所属し、随一の剣の腕を誇る曹長。

      真面目な性格が災いして思い詰めてしまうこともあるが、一度心を決めたら一直線に突き進む。

      演目『ロイヤルリテイナー』より'
    ko: '제47특수부대 소속으로 최고의 검술을 자랑하는 상사.

      진지한 성격이 원인이 되어 고민하는 경우도 있지만, 한번 마음을 먹으면 올곧게 돌진한다.

      작품 [로열 리테이너]에서'
    zh_hant: '隸屬於第47特殊獵兵班的曹長，擁有首屈一指的劍術實力。

      雖然因為個性太過認真而導致時常鑽牛角尖，但只要下定了決心就會勇往直前。

      取自戲碼『忠誠侍從』'
