  obtain_route_flags: 0
  party_skill_id: 154
  party_skill_level_id: 2
  party_skill_type: 5
  personality_id: 2
  profile:
    en: '"I''m a lump of iron created to kill humans!" The "Chariot" follows orders
      and hunts down the citizens. Just when the iron weapon is about to fire...someone
      puts an evening primrose into the mouth of the cannon. From "Performance Festival"
      Play - Act 2.'
    ja: '「アタシは、人を殺すために生み出された鉄の塊さ！」

      命令に従い、市民たちを追い詰めた『戦車』。

      鉄の武器が火を吹く直前……その砲口に、一輪の月見草が挿された。

      ――『劇フェス』戯曲・第二幕より'
    ko: '[나는 사람을 죽이기 위해 탄생한 쇳덩어리다!]

      명령에 따라 시민들을 몰아붙이는 [전차].

      철로 된 무기가 불을 뿜기 직전... 포구에 한 송이 달맞이꽃이 꽂혔다.

      ――[극페스] 희곡・제2막에서'
    zh_hant: '「我，是為了殺人而誕生的鐵塊！」

      『戰車』遵從命令將市民們逼入絕境。

      在他的鐵砲冒出火花的前一刻……那管砲口，被插入了一束月見草。

