      from his brazen attitude, he's actually an affectionate and delicate man, afraid
      to show his true self. From "Loyal Retainer."
    ja: '第４７特殊猟兵班、随一の遊び人で自由人。人を食った態度からコヨーテとあだ名されるが実際は愛情深く、胸中を知られるのを恐れる繊細な人。

      演目『ロイヤルリテイナー』より'
    ko: '제47특수부대 최고의 한량이자 자유인. 남을 사뭇 깔보는 태도 때문에 코요테라는 별명이 붙었지만 실제로는 애정이 깊고 본심이 드러나는
