      작품 [로열 리테이너]에서'
    zh_hant: '隸屬於第47特殊獵兵班，是當中最懷有玩心且行事隨心所欲的人。雖因態度傲睨自若而得到郊狼這個綽號，但他其實用情深切，是個心思細膩且害怕被人窺探內心的人。

      取自戲碼『忠誠侍從』'
