      그는 깊은 우정을 느끼게 되었다.

      작품 [YIN-YANG]에서'
    zh_hant: '他為人正直且不曾有過半點污點，是個備受周遭信賴的武士。在面對無法靠一己之力解決的怪異時借助了晴明的力量，並因此與晴明建立了深厚的友誼。

      取自戲碼『YIN-YANG』'
