  profile:
    en: A trapped crane is rescued by a man so she becomes a person and lives with
      him. Was it to to return the favor or are more complex emotions involved? From
      "Tsuru no Ongaeshi."
    ja: '罠にかかった鶴が青年に助けられ、人となって共に暮らす。恩返しが理由だったが、本当にそれだけだろうか。もっと複雑な愛情が、鶴にはあったのかもしれない。

      演目『鶴の恩返し』より'
    ko: '덫에 걸린 학은 청년에게 구출되어 사람이 되어 함께 살게 된다. 은혜 갚기가 그 이유였지만 정말 그것뿐이었을까. 학에게는 좀 더 복잡한
      애정이 있었을지도 모른다.

      작품 [은혜 갚은 학]에서'
    zh_hant: '一隻鶴曾在誤入陷阱時得到了一位青年的救助，此後她便化身成人與青年一起生活。鶴真的只是為了報恩才化身成人嗎？或許背後有份更複雜的情感在驅使著她也說不定呢。

      取自戲碼『鶴的報恩』'
