  profile:
    en: A brave girl sells matches barefoot in the cold weather. All for the sake
      of her precious family... Her wish becomes a flame that calls a lovely meteor,
      and becomes a shining star in the sky. From "The Little Match Girl."
    ja: '寒空のなか、裸足でマッチを売る健気な少女。すべては大事な家族のため……そんな優しい少女の願いは炎となり、愛しい流星を呼び、空に輝く星となった。

      演目『マッチ売りの少女』より'
    ko: '차가운 겨울 하늘 아래, 맨발로 성냥을 파는 갸륵한 소녀. 모든 것은 소중한 가족을 위해... 그런 상냥한 소녀의 소망은 불꽃이 되어
      사랑스러운 별똥별을 부르고 하늘에 반짝이는 별이 되었다.

      작품 [성냥팔이 소녀]에서'
    zh_hant: '在寒冬下，一名堅強的少女正打著赤腳地賣火柴。為了重要的家人，她不惜挨冷受凍……如此溫柔的她所許下的願望都化為了火焰、喚來了可愛的流星，並一同變成了在天上閃耀的星星。

      取自戲碼『賣火柴的少女』'
