  profile:
    en: Belle lives with her beloved family, but when her father is involved in an
      incident, she moves to an old castle where a terrifying beast is said to live.
      What awaits her there is a lonely beast and true love. From "Beauty & the Beast."
    ja: '大好きな家族と共に暮らすベルだったが、父親が事件に巻き込まれ、怖ろしい野獣が住むと言われる古城へ。そこで待っていたのは孤独な獣と、真実の愛だった。

