    ko: '사랑하는 가족과 함께 살던 벨은 아버지가 사건에 휘말리면서 무서운 야수가 살고 있다는 고성에 가게 된다. 그곳에서 기다리고 있던 것은
      고독한 야수와 진정한 사랑이었다.

      작품 [미녀와 야수]에서'
    zh_hant: '貝兒一直與深愛的家人一起生活，但為了解救被捲入某起事件中的父親，她決定隻身前往那座住了可怕野獸的古堡。在那裡等著她的是孤獨的野獸，還有真實的愛。

      取自戲碼『美女與野獸』'
