    zh_hant: 她總是我行我素、隨心所欲地走著自己的路，是中學部的問題學生。雖在唱歌與跳舞上都有很高的實力，但由於個性自由奔放，她總是會忍不住在表現時加入即興演出。據說她以前曾擔任過偶像團體的中心位置。
