  profile:
    en: Misty the clown laughs in the center of "BON☆BON Circus" despite their financial
      difficulties. Mischievous and cheerful, she loves everyone in her circus family.
      From "Your Show."
    ja: '経営難の『BON☆BON Circus』の中央で笑うのはピエロのミスティ。いたずら好きで悪びれない、明るい性格。なによりもサーカスのみんな……家族が大好き。

      演目『Your Show』より'
    ko: '경영난에 시달리는 [BON☆BON Circus]의 중앙에서 웃고 있는 사람은 피에로 미스티. 장난기가 많고 기죽지 않는 밝은 성격.
      무엇보다도 서커스 단원들... 가족들을 정말 좋아한다.

      작품 [Your Show]에서'
    zh_hant: '迷濛是『BON☆BON Circus』的小丑。她總是能神色如常地惡作劇，性格非常開朗。即使馬戲團正面臨財政困難，她也依舊笑臉迎人。對她而言最重要的就是形同家人的馬戲團成員們。

      取自戲碼『Your Show』'
