    ko: '세상에서 가장 유명한 괴도, 아르센 루팡. 자존심이 강하지만 실제로는 섬세한 인물. 변장의 달인이자 신사이며, 굉장한 모험가다.

      작품 [아르센 루팡]에서'
    zh_hant: '亞森･羅蘋是世界上最廣為人知的怪盜。他心思細膩，且有著很高的自尊心。他不只擅長變裝、為人紳士有禮，還是個冒險家。

