  profile:
    en: A knight belonging to the Sun Nation Knights. She belongs to the garrison
      of the citadel and is good at providing cover in battle. She wields her sword
      to protect the people of her precious town. From "The Wartime of Farewells."
    ja: '太陽騎士団に属する騎士。城下町の守備隊に所属しており、戦闘では援護を得意とする。大切な町の人々を守るため、彼女は剣を振るう。

      演目『別れの戦記』より'
    ko: '태양 기사단에 소속된 기사. 마을의 수비대에 소속되어 있으며 전투에서는 엄호에 능숙하다. 소중한 마을 사람들을 지키기 위해 그녀는
      검을 휘두른다.

      작품 [이별의 전기]에서'
    zh_hant: '隸屬於太陽騎士團的騎士。她同時也隸屬於城鎮裡的警備隊，並擅長在戰鬥中掩護我方。為了守護她所愛的小鎮以及鎮上的居民，她今天也在揮劍戰鬥。

      取自戲碼『離別的戰記』'
