  profile:
    en: Until the day of his assassination, he was the symbol of Rome. He held all
      kinds of important positions and was loved and envied by many people. His memory
      still lives on. From "Julius Caesar and Brutus."
    ja: '暗殺されるその日まで、彼はローマの象徴であった。あらゆる要職につき、多くの人々に慕われ、そして妬まれた。しかし彼の想いはなお、こうして語り継がれている。

