    ko: '암살당하는 그날까지 그는 로마의 상징이었다. 수많은 요직에 오르며 많은 사람들에게 사랑받았고 또한 질투 받았다. 그러나 그의 생각은
      여전히 이렇게 전해내려오고 있다.

      작품 [줄리어스 시저와 브루투스]에서'
    zh_hant: '在被暗殺以前，他一直都是羅馬的象徵。他在世時曾擔任許多要職，受到世人景仰，卻也遭人妒忌。但他的理念至今仍被眾人傳唱。

      取自戲碼『尤利烏斯・凱薩與布魯圖斯』'
