  profile:
    en: He lived in poverty, helping his mother sell sandals and woven mats, but in
      reality, he was distantly related to the imperial Han lineage. He rallies an
      army with the help of Guan Yu and Zhang Fei to reform society. From "Curious
      Tales of the Three Kingdoms."
    ja: '母と二人で草履や筵を織って生計を立てる、貧しい暮らしをしているが、その実、漢王室の血を引くプリンスである。

      世直しのため、関羽や張飛と共に義勇軍を旗揚げする。

      演目『三国志奇譚』より。'
    ko: '어머니와 둘이서 짚신이나 돗자리를 짜서 생계를 잇는 가난한 생활을 하고 있지만, 실은 한나라 황실의 피를 잇는 황손이다.

      세상을 바로잡기 위해 관우, 장비와 함께 의용군을 일으킨다.

      작품 [삼국지 기담]에서'
    zh_hant: '幼年時，與母親一同以編織草鞋和草蓆維生。雖然生活十分困苦，但劉備身上其實流著漢朝的皇室血脈。

      為了改變天下局勢，他與關羽、張飛一同組建義勇軍，揭竿而起。

      取自戲碼『三國志奇譚』。'
