    ko: '카무아타츠히메라는 이명을 가진 꽃의 신. 코노하나사쿠야히메를 아내로 맞이하면 번영을, 그리고 그녀의 언니 이와나가히메를 아내로 맞이하면
      영원한 생명을 얻을 수 있다고 알려져 있다.

      작품 [무수한 신들의 이야기]에서'
    zh_hant: '別名為神阿多都比賣的花神。據說迎娶木花開耶姬為妻會得到繁榮，而迎娶其姊石長比賣則會得到永生。

      取自戲碼『八百萬四方山話』'
