  profile:
    en: Despite having Han royal blood, he lived in poverty. After drinking, he becomes
      brothers-in-law with Guan Yu and Zhang Fei, and ends up leading a volunteer
      army. From "Curious Tales of the Three Kingdoms."
    ja: '実は漢王室の血を引いているが、貧しい暮らしに身を置く青年。酒を飲んだ勢いで関羽、張飛と義兄弟の契りを交わしてしまい、義勇軍を率いる羽目になる。

      演目『三国志奇譚』より。'
    ko: '실은 한나라 황실의 피를 물려받았으나 가난하게 살던 청년. 술을 마시고 취기에 그만 관우, 장비와 의형제를 맺게 되어 의용군을 이끄는
      처지에 놓이게 된다.

      작품 [삼국지 기담]에서'
    zh_hant: '這位青年雖過著清貧的生活，但其實他身上流著漢朝的皇室血脈。一次他在喝酒後順勢跟關羽和張飛結拜為義兄弟，且陷入了不得不率領義勇軍的困窘。

      取自戲碼『三國志奇譚』。'
