  profile:
    en: Seiran General Art Institute Stage Department Performance Major, Sub Leader.
      Mahiru's junior high school friend. She was close to her and also saw her as
      her rival. The two got separated after Suzu collapsed during joint practice.
    ja: '青嵐総合芸術院　舞台学科　ステージ専攻　サブチーフ。

      まひるの中学時代の同級生。まひるの親友であり、ライバル。まひるとの練習中に事故を起こしてしまい、そのことがきっかけで二人は離れ離れになってしまう。'
    ko: '세이란 종합 예술학원 무대학과 스테이지 전공 서브 치프.

      마히루의 중학교 시절 동급생. 마히루와 절친한 친구이자 라이벌. 마히루와 함께 연습하던 중에 사고를 일으켜버려 그 일을 계기로 둘은 뿔뿔이
      흩어지게 되었다.'
    zh_hant: '青嵐總合藝術學院　舞台學科　舞台主修　副首席。

      真晝的國中同學。也是真晝的摯友兼勁敵。在與真晝一同練習時曾引發過事故，這件事讓兩人在不知不覺間漸行漸遠。'
