  profile:
    en: Having become sworn brothers with Liu Bei and Guan Yu, they agree to raise
      their armies together. People tend to see him as fierce because of his imposing
      figure, but he is actually scared of small bugs. From "Curious Tales of the
      Three Kingdoms."
    ja: '酒の席で意気投合した劉備や関羽と義兄弟の契りを結び、共に軍を旗揚げする。

      その堂々たる佇まいから猛将と思われがちだが、虫一匹で大騒ぎするほどの小心者である。

      演目『三国志奇譚』より。'
    ko: '술자리에서 의기투합한 유비, 관우와 의형제를 맺고 함께 군을 일으킨다.

      그 당당한 자태는 용맹스러운 장수로 여기게 하지만, 벌레 한 마리에 호들갑을 떨 정도로 소심하다.

      작품 [삼국지 기담]'
    zh_hant: '張飛與在酒會上意氣相投的劉備以及關羽結拜為義兄弟，並一同組建了軍隊，揭竿而起。

      雖然他的站姿威風凜凜，看起來就像是一名猛將，但他的個性其實十分膽小，一隻小蟲就能讓他陷入混亂。

      取自戲碼『三國志奇譚』。'
