      the witch and protect his sister. From "Hansel and Gretel."
    ja: 'ヘンゼルとグレーテルは森の奥深くで、お菓子の家に住む恐ろしい魔女に出会った。ヘンゼルは妹を守るため、知恵を振り絞り立ち向かう。

