      작품 [헨젤과 그레텔]에서'
    zh_hant: '漢賽爾與葛麗特在森林的深處遇上了住在糖果屋裡的恐怖魔女。為了守護妹妹，漢賽爾想盡辦法挺身對抗魔女。

      取自戲碼『糖果屋』'
