    ja: '劉備、関羽と桃園の契りを結び義兄弟となり、行動を共にする。強そうな見た目だが実は一度も戦闘したことがない、実力は未知数の『猛将』である。

      演目『三国志奇譚』より'
    ko: '유비, 관우와 도원결의를 맺고 의형제가 되어 함께 행동한다. 겉모습은 강해 보이지만 실제로는 한 번도 전투를 해본 적이 없는 실력은
      미지수인 [맹장]이다.

      작품 [삼국지 기담]에서'
    zh_hant: '他與劉備和關羽結拜為兄弟並一起行動。雖然他看起來非常強悍，但其實從未上過戰場，是位實力為未知數的『猛將』。

      取自戲碼『三國志奇譚』'
