  profile:
    en: There are many stories about Jeanne d'Arc, and their interpretations vary
      widely. What they all have in common, however, is that they depict her as deeply
      awe-inspiring. From "The Life of Jeanne d'Arc."
    ja: 'ジャンヌ・ダルクを描いた物語は多く、その解釈は多岐にわたる。しかし共通しているのは、その姿が見る者に深い感動と勇気を与えるという点だろう。

      演目『ジャンヌ・ダルクの生涯』より'
    ko: '잔 다르크를 다룬 작품들은 많으며, 그 해석도 다양하다. 하지만 공통점이 있다면 그녀의 모습이 보는 이들의 마음에 깊은 감동과 용기를
      불러일으킨다는 점일 것이다.

      작품 [잔 다르크의 생애]에서'
    zh_hant: '描寫聖女貞德的故事數之不盡，各個故事對她的解讀也截然不同。但當中唯一共通點，就是任何人看到她那堅毅的姿態，都會深受感動並從中獲得勇氣。

      取自戲碼『聖女貞德的生涯』'
