      able to after incurring the resentment of the other members of the chorus team.
    ja: '青嵐総合芸術院　舞台学科　ステージ専攻　サブチーフ。

      ななの中学時代の同級生。ななと一緒に舞台を創ろうとしていたが、当時所属していた合唱部のメンバーから不興を買い、ふたりが同じ舞台に立つことは叶わなかった。'
    ko: '세이란 종합 예술학원 무대학과 스테이지 전공 서브 치프.

      나나의 중학교 시절 동급생. 나나와 함께 무대를 만들려 했지만 당시 소속했던 합창부 멤버들의 눈 밖에 나 두 사람이 같은 무대에 서는 바람은
      이루어지지 않았다.'
    zh_hant: '青嵐總合藝術學院　舞台學科　舞台主修　副首席。

      奈奈的國中同學。曾經想與奈奈一同創造舞台，卻因此舉惹怒了當時所屬的合唱團團員，而無法實現一同登台的願望。'
