  profile:
    en: Guan Yu becomes sworn brothers with Liu Be over drinks, and swears he'll give
      his life for the reunification of the Han Dynasty. His only fault​ is that he
      loses control of himself during battle. From "Curious Tales of the Three Kingdoms."
    ja: '酒の席で出会った劉備に心酔し、義兄弟の契りを結ぶ。以降、劉備を兄者と慕い、漢王朝再興のために命がけで闘う。戦になると我を忘れてしまうのが玉に瑕。

      演目『三国志奇譚』より。'
    ko: '술자리에서 만난 유비에게 감동해 의형제를 맺는다. 이후 유비를 형님으로 모시며 한왕조 재흥을 위해 목숨을 걸고 싸운다. 싸움이 시작되면
      무아지경이 되는 것이 옥에 티.

      작품 [삼국지 기담]에서.'
    zh_hant: '關羽在酒會上遇到劉備，被他的意志和氣概所吸引並與他結拜為義兄弟。其後，他便將劉備當作兄長般敬佩，並為復興漢朝而拼命戰鬥。一遇到戰鬥就會投入得忘了自我是他唯一的瑕疵。

      取自戲碼『三國志奇譚』。'
