  profile:
    en: Why did the Queen seek the utmost beauty in the world? It was because someone
      close to her represented it. Jealousy became delusion, ultimately turning into
      poison and eating everything away. From "Snow White—a Play."
    ja: 'お妃はなぜ世界一の美しさを求めたのか？　それは身近に、真実の美を備えた者がいたから。その嫉妬は妄執となり、毒に変わってすべてを蝕んだ。

      演目『舞台・白雪姫』より'
    ko: '여왕은 어째서 세상에서 가장 아름다운 사람이 되고자 했는가? 그 이유는 가까운 곳에 진실한 아름다움을 갖춘 자가 있었기 때문. 질투는
      집념이 되어 독으로 변해 모든 것을 잠식해 간다.

      작품 [무대 백설공주]에서'
    zh_hant: '為什麼皇后要追求世上最美的容貌？那是因為具備了真正的美的人，就在她的身邊。那份嫉妒化為執迷，進而化為毒液將一切侵蝕殆盡。

      取自戲碼『舞台・白雪公主』'
