  profile:
    en: To revive the Han Dynasty, he forms an alliance with Liu Bei and Zhang Fei
      in the Peach Garden. He is always calmly aware of the war, but he goes into
      battle in search of someone stronger than himself, and according to Zhang Fei,
      he is a battle fanatic. From "Curious Tales of the Three Kingdoms."
    ja: '漢王朝再興のため、劉備、張飛と桃園の契りを結ぶ。常に冷静に戦況を把握しているが、自分より強い者を求めて戦に臨む姿は、張飛曰く『戦闘狂』。

      演目『三国志奇譚』より。'
    ko: '한왕조 재흥을 위해 유비, 장비와 도원결의를 맺는다. 항상 냉정하게 전황을 파악하고 있으나 자신보다 강한 상대를 찾아 전투에 임하는
      모습은 장비가 말하기를 [전투광]과도 같다고 한다.

      작품 [삼국지 기담]에서'
    zh_hant: '為了復興漢朝，關羽與劉備、張飛在桃花園林中結拜為兄弟。雖然關羽總是冷靜地分析戰況，但他同時也渴求著與更強的人戰鬥，其熱血的身姿更被張飛稱為『戰鬥狂』。

      取自戲碼『三國志奇譚』'
