  profile:
    en: For the earth she longed for and the prince she missed, the mermaid princess
      gave up her voice and her home. Finding love from the bottom of her heart in
      the new world, she lived happily for that moment. From "The Little Mermaid."
    ja: '憧れの地上と恋しい王子のため、人魚姫は声と故郷を捨てた。新しい世界で心からの愛を見つけた人魚姫はそのひとときを幸福に生きた。

      演目『朗読劇　にんぎょひめ』より'
    ko: '동경하던 육지와 사랑하는 왕자를 위해 인어공주는 목소리와 고향을 버렸다. 새로운 세상에서 진정한 사랑을 찾은 인어공주는 그 짧은 시간을
      행복하게 살았다.

      작품 [낭독극 인어공주]에서'
    zh_hant: '憧憬地上生活、愛慕著王子的人魚公主放棄了自己的聲音與故鄉。她在新世界裡找到真愛，並度過了片刻的幸福時光。

      取自戲碼『朗讀劇 人魚公主』'
