      big heart that has a compassionate attitude no matter what happens. She fights
      demons with her two cross-shaped machine guns named "Raphael" and "Gabriel".
    ja: 'ドジでおっちょこちょいだが、いつも笑顔を絶やさない

      なにが起きても、広い心ですべてを包みこむシスター。

      ラファエルとガブリエルの名を冠するマシンガンで

      悪鬼羅刹を吹き飛ばす。'
    ko: '덤벙대고 실수가 많지만 늘 웃는 얼굴을 하고

      무슨 일이 생겨도 넓은 마음으로 모든 것을 감싸안는 수녀.

