1,"party_skill_id":154,"party_skill_level_id":2,"party_skill_type":5,"personality_id":2,"profile":{"en":"The \"Tower\" – a machine intelligence inhabiting a spaceship shot from Earth. Tasked with delivering the 'Star Girl' to the Moon, the ship is hit and bursts into flames. In that moment amid the flames, the \"Tower\" makes a decision. From \"Performance Festival\" Play - Act 5.","ja":"『塔』――それは地上より打ち上げられた宇宙船の機械知性。『星の少女』を月に送り届ける最中、船は攻撃を受けて燃え上がる。生と死のはざま、炎の奥で『塔』はある決断をくだす。\n――『劇フェス』戯曲・第五幕より","ko":"[탑]―― 그것은 지상에서 발사된 우주선의 기계지성이다. [별의 소녀]를 달에 보내던 중, 우주선은 공격을 받고 불타오른다. 생과 사의 갈림길, 불꽃 속에서 [탑]은 어떤 결단을 내린다.\n――[극페스] 희곡・제5막에서","zh_hant":"『塔』――那是從地上發射出的宇宙船之機械知性。在運送『星之少女』前往月亮時，由於艦體受到攻擊而燃燒。在熊熊烈火的生死之隙中，『塔』做出了某個決定。\n――取自『戲劇慶典』戲碼・第五幕"},"published_at":1604041200,"rarity_up_cost_id":1,"remake_cost_id":1,"role_index":21010,"sub_tactics_skill_id":0,"trait_id":55,"win_sequence_id":1871,"_id_":1020004},"1020017":{"attack_type":2,"attribute_id":4,"auto_skill1_id":12010,"auto_skill1_release_rank":1,"auto_skill1_type":1,"auto_skill2_id":22005,"auto_skill2_release_rank":4,"auto_skill2_type":2,"auto_skill3_id":22095,"auto_skill3_release_panel_number":5,"auto_skill3_release_rank":9,"auto_skill3_type":2,"auto_skill4_id":10146,"auto_skill4_release_panel_number":5,"auto_skill4_release_rank":9,"auto_skill4_type":1,"auto_skill5_id":0,"auto_skill5_release_panel_number":0,"auto_skill5_release_rank":0,"auto_skill5_type":0,"base_agi":209,"base_atk":283,"base_hp":2040,"base_mdef":97,"base_pdef":161,"base_rarity":4,"chara_id":102,"command_skill1_id":3471,"command_skill2_id":3472,"command_skill3_id":3473,"command_unique_skill_id":3474,"confusion_skill_id":3475,"cost":15,"cri":50,"delta_agi":3440,"delta_atk":4670,"delta_hp":67210,"delta_mdef":1600,"delta_pdef":2660,"dex":5,"dress_episode_id":1020017,"dress_type":0,"entry_skill_id":0,"eva":0,"friendship10_reward_adventure_id":3010200171.0,"friendship15_levelup_adventure_id":3110200171.0,"friendship25_reward_adventure_id":3010200172.0,"friendship30_levelup_a