ofile":{"en":"\"In any era of any world...the \"Lovers\" are fated to be torn apart\". Mourning resonates in the space between time, but at the same time they know. Their feelings for each other will overcome any trial. From \"Performance Festival\" Play - Act 5.","ja":"「どの時代どの世界でも……『恋人』は引き裂かれる運命なのね」\n時の狭間に嘆きが響く。だが同時に知っていた。\n恋する者たちの想いがあらゆる試練を越えてゆくことを。\n――『劇フェス』戯曲・第五幕より","ko":"[어떤 시대, 어떤 세계이건... '연인'은 갈라놓아질 운명인 거네]\n시간의 틈새에 비탄이 울려 퍼진다. 하지만 동시에 알고 있었다.\n사랑하는 이들의 마음이 모든 시련을 극복해 나간다는 것을.\n――[극페스] 희곡・제5막에서","zh_hant":"「不論身處什麼時代與世界……『戀人』終將迎來分離的命運」\n嘆息聲於時空的夾縫中響起。但我卻也在同時明白，\n墜入情網者的思念將能夠跨越所有試煉。\n――取自『戲劇慶典』戲碼・第五幕"},"published_at":1619247600,"rarity_up_cost_id":1,"remake_cost_id":1,"role_index":25050,"sub_tactics_skill_id":0,"trait_id":3,"win_sequence_id":2747,"_id_":1040005},"1040016":{"attack_type":2,"attribute_id":4,"auto_skill1_id":22365,"auto_skill1_release_rank":1,"auto_skill1_type":2,"auto_skill2_id":22488,"auto_skill2_release_rank":4,"auto_skill2_type":2,"auto_skill3_id":22429,"auto_skill3_release_panel_number":5,"auto_skill3_release_rank":9,"auto_skill3_type":2,"auto_skill4_id":0,"auto_skill4_release_panel_number":0,"auto_skill4_release_rank":0,"auto_skill4_type":0,"auto_skill5_id":0,"auto_skill5_release_panel_number":0,"auto_skill5_release_rank":0,"auto_skill5_type":0,"base_agi":217,"base_atk":266,"base_hp":1093,"base_mdef":110,"base_pdef":74,"base_rarity":4,"chara_id":104,"command_skill1_id":4065,"command_skill2_id":4066,"command_skill3_id":4067,"command_unique_skill_id":4068,"confusion_skill_id":4069,"cost":13,"cri":50,"delta_agi":3580,"delta_atk":4390,"delta_hp":36020,"delta_mdef":1820,"delta_pdef":1230,"dex":5,"dress_episode_id":1040016,"dress_type":0,"entry_skill_id":0,"eva":0,"friendship10_reward_adventure_id":3010400161.0,"friendship15_levelup_adventure_id":3110400161.0,"friendship25_reward_adventure_id":3010400162.0,"friendship30_levelup_adventure_id":3110400162.0,"friendship_pattern_id":134,"get_voice":"v21010002_004","growth_board1_id":13204101,"growth_boar