の噂を聞く。\n人を救うは神の奇跡のみ――自らの信仰を否定する男を捕えた女教皇。だが処刑の日、彼女は『人が起こす奇跡』を見る。\n――『劇フェス』戯曲・第一幕より","ko":"돌림병을 근심하는 [여교황]은 병을 치료하는 의사의 소문을 듣는다.\n인간을 구하는 것은 신의 기적뿐―스스로의 신앙을 부정하는 남자를 체포한 여교황. 그러나 처형일에 그녀는 [인간이 일으키는 기적]을 본다.\n―[극페스] 희곡 제1막에서","zh_hant":"憂心傳染病的『女教皇』在無意間得知了有醫生能治癒傳染病。\n堅信能拯救世人的唯有神之奇蹟的女教皇，下令逮捕了否定自身信仰的男人。但在處刑之日，她卻親眼目睹了『人所創造的奇蹟』。\n――取自『戲劇慶典』戲碼・第一幕"},"published_at":1609657200,"rarity_up_cost_id":1,"remake_cost_id":1,"role_index":35050,"sub_tactics_skill_id":0,"trait_id":15,"win_sequence_id":2123,"_id_":1060015},"1060017":{"attack_type":1,"attribute_id":3,"auto_skill1_id":20024,"auto_skill1_release_rank":1,"auto_skill1_type":2,"auto_skill2_id":12090,"auto_skill2_release_rank":4,"auto_skill2_type":1,"auto_skill3_id":22080,"auto_skill3_release_panel_number":5,"auto_skill3_release_rank":9,"auto_skill3_type":2,"auto_skill4_id":0,"auto_skill4_release_panel_number":0,"auto_skill4_release_rank":0,"auto_skill4_type":0,"auto_skill5_id":0,"auto_skill5_release_panel_number":0,"auto_skill5_release_rank":0,"auto_skill5_type":0,"base_agi":209,"base_atk":284,"base_hp":2058,"base_mdef":100,"base_pdef":149,"base_rarity":4,"chara_id":106,"command_skill1_id":2419,"command_skill2_id":2420,"command_skill3_id":2421,"command_unique_skill_id":2422,"confusion_skill_id":2423,"cost":15,"cri":50,"delta_agi":3440,"delta_atk":4690,"delta_hp":67800,"delta_mdef":1660,"delta_pdef":2470,"dex":5,"dress_episode_id":1060017,"dress_type":0,"entry_skill_id":0,"eva":0,"friendship10_reward_adventure_id":3010600171.0,"friendship15_levelup_adventure_id":3110600171.0,"friendship25_reward_adventure_id":3010600172.0,"friendship30_levelup_adventure_id":3110600172.0,"friendship_pattern_id":133,"get_voice":"v21010002_004","growth_board1_id":13103101,"growth_board2_id":13103201,"growth_board3_id":13103301,"growth_board4_id":13103401,"growth_board5_id":13103501,"growth_board6_id":13103601,"growth_board7_id":13103701,"growth_board8_id":13103801,"growth_board9_id":13103901,"hit":0,"leader_tactics_skill_id":0,"model_id":1060017,"